    "address": "167, Parekh Compound, CST Road, Kalina, Santacruz East, Mumbai, Mumbai, Maharashtra, India",
    "price_score": 2,
    "cuisines": "Chinese",
    "schedule_status": "Open now",
    "schedule_hours": " 11:30 PM - 15:30 AM",
    "reviews": ["Typical food joint, good taste and service. Recommended for office people around it.", "Less tables to sit but decent food", " Taco Cheena is well known one of the few restaurants on CST road located in same building as Tender Fresh Ice Cream. They have renovated the place sometime back and made it  comfortable seating for 4-6 people on a table. Food menu is elaborate though more on non-vegetarian side.  Staff is efficient and quick on service. Food comes fast until and unless they are packed. This is good option for nearby office crowd when craving for Chinese food. Food taste is amazing and it comes in good quantity total value for money. They give fried noodles & Shezwan for sides and trust me their Shezwan is one of the best that I have eaten and you can make out that it is freshly made in-house by them as the bottled ones usually taste different due to preservatives.  We order for Paneer starter (forgot the name) and trust me I never expected it to be this tasty and presentable. Main Course we order Hakka Noodles (I loved this one just cooked nice and crunchy with right amount of veggies) and Vegetarian Manchurian (this came piping hot fresh and nice taste). Overall a good option for Chinese food easy on pocket. "],
