    "reviews": ["Best place to hangout with family and friendsHas a great ambience.", "We ordered in from chawlas as they had some really great food. They are an age old brand and an epitome of good Indian food. Here's what we ordered. 1. Chicken lababdar - the chicken lababdar was a really delicious gravy loaded with chicken and masala. 2. Masala chicken - the masala chicken was yet another delicious gravy that had tikka fried pieces of chicken. 3. Special crispy chicken - the crispy chicken was coated with a light batter and then tossed in a delicious sauce. 4. Butter chicken biryani with Raita - the butter chicken was loaded with a whole load of masala and served with a large bowl of raita.", "lot of items in menu not available"],
