    "reviews": ["NYC service, good place and coffee, and waffle", "It was after shopping at the hill road that we went it for a nice talk as it had also been raining then. Just as you enter you are greeted with beautiful smiles & Good after noon mam! And I was super impressed. The decors were simple; keeping the space issues of Mumbai in mind, were pretty spacious tooWe order 2 ginger tea, grilled chicken from the all day menu & bread toasts. I was super impressed with the quantity of butter that was served with toaster breads - a benchmark! Then grilled chicken was grilled to perfection; the mushrooms & the sauce on top of it were complete delight - I would have loved mashed potatoes though! The chai has a good enough scope for improvement; wasn't quite impressed with that!On the whole, I had a good dining experience & would definitely love to be there again!", " Di bellaccino coffee had absolutely no caramel and the whipped cream in my oreo frappe tasted sour and bad  "],
