    "reviews": [" We revisited\u00a0 an old favourite, a place we frequented when we were much younger. We were happy to find that not much has changed. This time we tried the Chicken Hao Soup, a flavourful broth, loaded with chicken and mushroom. The delicate flavour of ginger and spring onion would be just what you need if , you have a cold or are feeling a bit under the weather. The Chindian Fusion Lamb rice was a large serving, good enough for two. Gravy and rice all in one bowl. The lamb was perfectly cooked. A great meal, all in all. ", " I had ordered chicken lollypop which they serve raw from inside, triple Schezwan rice was so bad. No salt no taste even my cat didn&#039;t liked the chicken. Worst ever experienced. ", " Been visiting this place for last 4 years and from the time they changed their location, the food quality has definitely gone down. Miss the yummy food they use to serve in past. I hope they improve their food quality. Everything seems bland. "],
