    "reviews": ["Food is Fantastic with the right blend of spices and sauces. The Chilean Sea Bass is absolutely Amazing and a Must Try. I only wish the Ambience and Presentation of The Ordered Dishes was better.", "Overpriced, quantity was less", "What are some of the signature dishes here?Some of the stand out dishes include the Brie and Truffle Souffle, Sheesha of Chilled Melon Gazpacho with Coconut Snow, Cry-o-pac Three Mushroom Ravioli with Roasted Oats and Black Perigord Air, Lobster Tail with Caviar, Orange, Baby Spinach and Panca Aioli, Chocolate Millefeuille and the Chocolate Shawarma.What can regulars who enjoyed your style at the Taj look forward to at this new restaurant?My regulars can expect an evolved, upgraded and advanced version of all their signature favourites. They can look forward to me being very much hands-on in running my flagship restaurant and they can stay tuned for a lot of surprises."],
