    "longitude": 72.83393908,
    "address_formatted_short": "3rd Floor",
    "rating": "#225 of 23566 restaurants in Mumbai",
    "rank_type_id": 5,
    "top_ratings": ", Pub & bar",
    "phone": "(+91) 9167666742",
