    "address": "3rd Floor, Mumbai, Maharashtra, India, 400050",
    "price_score": 1,
    "cuisines": "Chinese",
    "schedule_status": "Open now",
    "schedule_hours": " 12:00 PM - 01:00 AM",
    "reviews": ["TAP is a hilarious pub in Bandra suburb. Chicken Tacos, Hot Wings & Cocktails\/Shots enthralled our taste buds. Intermittent steps with mostly youngsters took me to 20s????. Host&#039;s sense of hospitality & decor is highly appreciated.", " Great place to grab and drink and grove to your favourite song.weekends are little crowdy.everything was good except for the waiter charged us extra for something we didnt order and confused us so much that we ended up paying for something we didnt order.food was okayish..i will give full points to ambeince and crowd ", " 19 October 2019\n\nHaving visited TAP&#039;s Atria mall outlet, I knew that the experience was going to be great and so it was. This review is going to be comparison between both their outlets.\n\nAtria outlet&#039;s ambience is marvelous. Bandra one does not out do it but it doesn&#039;t disappoint either. They have a well stocked bar a few steps from the entrance. Their long rectangular main section has tables with couches which can accommodate groups of 4-6 on one side, high rise tables for 3 on the opposite side, tables for 2s right ahead, besides the DJ console and one section with 3 couches at the fag end on the right. That section is cut off from the rest of the restaurant making it perfect for a date! ????\n\nThe vibe did not feel energetic may be because 5 PM onwards, it was supposed to be a dry day. Music was not engaging either. Service was just alright.\n\nTAP&#039;s USP is the wide range of offers they have and the flexibility they offer to club them. We clubbed a TAP 5 on 5 with 1+1 on Zomato Gold. We still ended up spending \u20b96,000 for a drunch. Spent close to 6 hours there. Extended drunch you may say.\n\n10 pints of Kingfisher ultra, 2 jaeger bombs (60ml each) and 2 blue shark shots comprising of blue curacao and vodka. Basically, we drank our money quite unapologetically.\n\nAvoid the *nachos del compo.* Seeing cucumber in nachos was a MAJOR let down. Besides it had insufficient dressing.\n\n*Paneer dhaniya tikka* and *corn cheese balls* were fantastic. Both easily serve 2, perfect taste as well. No jazzy presentation. Not complaining either.\n\nAt the Atria mall outlet, I had had only non veg which was spectacular and reasonably priced as well. My suggestion would be to call for more non veg than veg and certainly skip the nachos.\n\nTAP is definitely worth a visit, even a repeat for that matter. Go with unlimited time on hand and an unlimited appetite for drinks. Cheers! ???? "],
