    "reviews": [" Visited the Yoga House a few days ago with a friend. The ambience is awesome. Tried the Avocado Toast, the Fig Salad and the Moroccan Sald. Food was pretty good.\u00a0 Will visit again. ", " It is a very nice place to explore for all day breakfast. They have an amazing food spread and everything that we had was freshly made. It&#039;s a peaceful place for people to sit back, work and enjoy a nice morning with some fantastic healthy food. ", "THE YOGA HOUSE - \nFOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Nargis Villa, Sherley Rajan Road, Opposite ICICI Bank, Carter Road, Bandra West, Mumbai.\nCUISINE: CAF\u00c9, HEALTHY FOOD\nAVERAGE COST: 1500 for two people (approx.)\nWORKING HOURS: 8 AM \u2013 10:30 PM. \nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: YES\nVALET PARKING: NO\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: YES\n.\nWhat we love here: Salad, Burgers, Paneer Bhurji, Sandwich, Hash Brown, Poha, Carrot Cake.\n.\nWhy Visit: In the hustle bustle of the city you can definitely nudge yourself to be at a place that will bring peace to your life.\n.\nLocation: 4.5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbience: 5\nHygiene: 5\nService: 4.5\nCost: 4\n.\nOur Review: 5\/5\nThe Yoga House is located at Bandra. A hidden gem in Bandra and a must visit for those seeking calm and relaxation, a place where you can spend hours reading or writing in peace. The cosy rustic interiors transport you to Goa or pondicherry, while the food is healthy and tasty at the same time. It feels like a home. Once you enter the house, the decoration of lights and plants kept aside the window will mesmerize you. As you climbed the stairs on the left there is the small corner dedicated for doing yoga. Then after setting the foot on few stairs you are welcomed by a beautiful couple who were selling very healthy drinks made out of beetroot, ginger lemon, pomegranate etc. Coming to the food, if you visit here in morning, don\u2019t forget to eat Poha or Signature Oats Porridge you can even try their combination breakfast known as the quick off breakfast. Basically all the food, beverages you order here are made from health point of view so no need of recommendation as their interesting menu will already clear your confusion on selection of food. The service of this place is good. Overall this place is a must visit if you want to experience something different and enjoy the healthy food in a calm and relaxing environment. .\n.\nDon\u2019t forget to follow our handle @foodreviewonline and for more such detailed restaurant reviews visit us on www.foodreviewonline.com .\n#foodreviewonline #kailashshahaniofficial #foodie"],
