    "reviews": [" Gave a reservation without a vacant table !! \nTable offered was very bad right at the entrance  ", " Thai was our plan and we thought of trying out Nara... The booking was easy through Zomato with a quick confirmation... As we got there,the ambience was very pleasing and gave an Asian feel... We seated ourselves on one of the smaller tables and went on to order their famous Papaya salad which was quite refreshing,crunchy with that tanginess of the lemons and spice from the chilies... We then went on to order their butterfly peas iced tea along with their appetizer with okra which was equally amazing... The okra were crunchy and well seasoned and we absolutely enjoyed them... With a lot of gossip and laughter with gorgeous looking plates of food doing the rounds we went on for our maincourse, we ordered a portion of the Khow Suey, the Thai chili basil rice and Pad Thai Noodles... The fried Thai rice was the best out of the three,with the Pad Thai following on... The rice was absolutely flavorsome and sent me back to Thailand... I was disappointed with the Khow suey as it was sweet and had an overpowering flavor which was unlike the Khow suey I have had at other Thai restaurants,it kind of had a powdery feel... But overall it was a good Thai meal with a beautiful ambience and enthusiastic staff... I however also missed the peanuts which feature a lot in the traditional Thai cuisines back in Thailand... Will definitely want to revisit to try the non-veg options they have to offer... ", " So we came for quick snack here but we ended up have a full 3 course meal...that place screams awesomeness!!!\nWe tried gai phad prik (stir fried chicken), phad kee mao ( chilli basil noodles). Last we ordered the dessert chocolate and kaffir lime bar which was the best thing which cannot be missed AT ALL!!\nThe food experience is made amazing by not just the food but also the server who makes the whole experience worthwhile!!!\nA big thank you to surendra for not only suggesting us great options but also keeping a radiant smile on his face every time he served us!!! \n "],
