    "reviews": ["Very good food!", "Well all I'd say is that you gotta get here to experience the goodness of this place. This not only serves amazing food but has an amazing ambience coupled with great service and live kitchen right in front of your eyes. We had a wide variety of delicacies here and all were great to the taste palate.Kurkuri Kand , mooli ki kachori, kaali daal, laal naan, baquerkhani, baked jaggery rosogolla all were simply amazing .Please please please visit this place for an amazing experience", "Taftoon Bar and Kitchen is located at Bkc at a prime location. The ambiance is amazing and the decor is really very classy. They have decorated the place beautifully with wooden furnitures and beautiful lantern lights. They serve amazing North Indian, Bengali, Lucknowi, Kashmiri, and Bihari. I visited this place few days back with my friend and had a wonderful experience. I would love to visit this place again.Coming to what we had in food:-They have an extensive menu with variety of options . We were served kashmiri kahwa as our welcome drink. It was something new for us had the authentic kashmiri taste.For starters :We had chotey kulchey chole - Mini masala stuffed kulchas topped with semi dry chickpea curry and pickles. It tasted amazing and the kulchas were prepared in a very tasty way.Kathal ki chapli - Raw Jackfruit, minced then spiced with garam masala, kala namak, red chilli and asafoetida cooked on tawa.Galauti kebab- Mutton was really soft, flavourful blended with smoked, browned onion paste, slow -cooked on mahi- tawa. This is a must try dish from this place..Mirza Hasnu Tikka- Gently spiced, very fragnant, boneless chicken marinated in tandoori spices, slow cooked and smoked.. You are going to love this dish for sure.Mains:Tawa kheema boti- Goat meat mince and chunks, shaved pink ginger, dhania, oniom, bhunaoed on a hot plate. Kheema boti is really luscious and tastes heaven.Goalondo Steamer Curry- Reminiscent of the quick curries made abroad steamers while crossing the seas, the base of onions, tumeric, chillies, red chilli powder . We combinecombined it with breads like zafrani taftoon, baquerkhani and laal naan. These were all different types of breads and all of them had a unique taste.We had two mocktails as well at the start and ended our meal with some amazing desserts Can't get over there dishes. Do visit this place they won't disappoint you with their food and hospitality."],
