    "reviews": ["To describe Imbiss in as few words as possible would to call it a Meat Paradise. Catering exclusively to the non vegetarian community, they have a huge number of innovative delights with great amount of servings at decently reasonable prices. Options range from burgers and steaks to salads and soups. Do try the ribs, sausages, wings and the chicken cordon bleu. They do not have much to offer in the infrastructure part, the restaurant being quite small in size, but they more than make up with the taste amd quality of their food.", "Awesome food", "Awesome and cozy place.. Cudos to the food and service staff."],
