    "longitude": 72.8302866,
    "address_formatted_short": "331, Doctor BR Ambedkar Road, Pali Hill",
    "rating": "#165 of 23566 restaurants in Mumbai",
    "rank_type_id": 5,
    "top_ratings": ", Seafood",
    "phone": "(+91) 2233951619",
    "website": "http:\/\/www.executiveenclave.com\/",
    "address": "331, Doctor BR Ambedkar Road, Pali Hill, Mumbai, Maharashtra, India",
    "price_score": 3,
    "cuisines": "Indian",
    "schedule_status": "Closes soon Reopens 19:30",
    "reviews": ["Veranda is beautiful casual dining restaurant with great ambience and lovely staff located at hill road bandra west.The hygene and cleanliness of this place was superb.Its huge size restaurant with great sitting area.We tried following lipsmaking dishes.\u2022chennai 1965 chicken : boneless chicken chunks was coated in batter and deep fried.after that it was tossed in south indian flavored gravy.it was fantastic dish.\u2022dhaba chicken platter : it was consisting three kinda tandoori chicken kebabs.malai chicken , tandoori chicken and pesto sauce green chicken kebabs.\u2022lasooni palak paneer : was expecting much from this dish but it came out average dish.as palak paneer gravy was not cooked with perfect spices.and paneer was bit hard. And served with lemon rice which was amazing and butter naan.\u2022grill oriental chicken breast : it was  grilled chicken with seasame seeds on top and served with hunan sauce and schezwan fried rice.overall combo was great especially rice.\u2022sin-derella : so basically sin derella is biscuits based desserd.biscuit crumbs was mixed with butter and shaped into rectangular pieces and on top of that hot chocolate and dry fruits are poured.\u2022gulkand chocobar : fantastic silky smooth chocolate bar with gulkand flavor infused in it.and garnished with chopped almonds.\u2022indian sunrise : it was  combination of orange juice , cranberry juice , peach , mints and garnished with orange.amazing combo mocktail.\u2022guava berry : it was little thick guava flavored drink in which berries was mixed too.and overall drink was 5\/5.\u2022snow white : This mocktail was combo of lychee , apple , coconut and served in margarita glass.\u2022ice wine tea sour : fantastic creation by varanda.would definitely suggest this drink to everyone.Overall my experience with varanda was lovely and would definitely visit again for sure.Also they keep live performance on Friday , Saturday & sunday.", "Nice place to chill when you are with friends..!!", "The veranda is a bright sunlit courtyard with an art deco vibe in the heart of Bandra serving up deconstructed modern Indian cuisine while keeping traditional flavorings intact. Space is a melting pot for artists both in a traditional and gastronomic sense coming together to offer a unique sensorial experience to all day diners with palate-pleasing dishes and vivid works of art exhibited around. Owner and head chef Monish Rohra adapted the banquet area of his family hotel into this hotspot of jazz and fine-dining, choosing to continue serving Indian cuisine but giving it a modern twist.\n\nWhat did we Order:\n\nSalads: (4.5 \/ 5 )\n\nCONTEM BEETROOT SALAD: \nLoved every bite of it. Its baby beetroot with Quinoa and dressing of Kasundi honey mustard dressing. It also had feta cheese and pieces of citrus fruit and pears.\n\nAppetizers: (3.5 \/ 5)\n\nRAJA DAHI VARMA:\nThis dish certainly didn\u2019t live to our expectations. Although the fritters were soft the dish felt overall really heavy and there are certainly better options to choose from.\n\nMAIN COURSE (3 \/ 5)\n\nRAJASTHANI GATTA NU SHAAK\n\nThis dish had certainly the right flavors but there was nothing exciting that you would have not experienced before if you are a food lover. I expected the innovation in this dish considering the place is run by a renowned chef. The dish is served with Raita and Sundried tomato Kulcha.\n\nSOMETHING TO DRINK:\n\nWe tried the Sula Rose by the glass and ended up becoming the highlight of the afternoon. It is unfortunate when a glass of wine becomes the star of your meal when you are clearly out there to experience something new for your taste buds.\n\nOverall review points:\n\nFood: 3.5 \/ 5 ( All though the food was decent I found limited options for Vegetarians. )\n\nService: 4.5\/5 ( Service and speed of execution was great also with the everlasting smile )\n\nAmbience: 4.0\/5 ( Perfect for Sunday laid back lazy Brunch and all though you are in the air-conditioned environment you would feel the vibe of bringing outdoors)"],
