    "reviews": ["SHD never disappoints, be it breakfast, lunch or dinner. A quaint place with great ambience and  always has a feel good factor.For breakfast do try their eggs to order which come with a side of toast, hash brown and tomato. Sliders are great for starters and the pastas are quite filling as well and could even serve 2 people. They also have membership option.", " We have been visiting smoke house for 4 years and every time I visit I feel like visiting again. The food is excellent. The peri peri grilled chicken is amazing. I love the red wine sangria. The lazy Sunday brunch has a variety of breakfast items to choose from and it is also unlimited. It is a nice cozy place to have any meal at. The staff is very friendly especially Mr. Kalpesh who always takes special care of us and gives us the best service possible.  ", " loved the ambience and food.\n "],
