    "schedule_hours": " 12:00 PM - 01:30 AM",
    "reviews": ["MIA CUCINA - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Bandra West, Mumbai\nCUISINE: Italian, Continental\nAVERAGE COST: 2000 for couple appx\nWORKING HOURS: 12.00 PM to 12.30 AM\nWHEELCHAIR FRIENDLY: NO\nOUTDOOR SEATING: NO\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO\n.\n.\nWhat we love here: Panini Verdura, Fig & Feta Salad, Spinaci-e-gorgonzola, Spaghetti Romesco, Pancake Glassato Ripieno, Warm Apple & Cinnamon Tart\n.\nWhy Visit: The place has a beautiful ambiance with lovely graffiti walls and rustic ambiance, a perfect Italian Bistro.\n.\n.\nLocation:5\nTaste:5\nQuantity:5\nPresentation:5\nAmbiance:4.5\nHygiene:5\nService:5\nCost: 5\n.\n.\nOur Review: 5\/ 5:\n@mia.cuccinna it means \"My kitchen\" located in Bandra, has a beautiful ambiance with lovely graffiti walls and rustic ambiance, a perfect Italian Bistro. The menu surely reflects some of the best Italian classic from Caesar Salad to best of the pasta and pizza, not to forget some of the most amazing Italian dessert. The plant hanging gives a very fresh feeling and complementing the decor with the helicopter frames & wall hangings.The sitting arrangement is comfortable.Coming to the food, we started oue meal with Verdura Panini, A great appetizer with veggies and cheese make a taste on your pallet . after that we had Spinaci e Gorgonzola. This pizza is loaded with spinach and blue cheese. Though the smell is a little pungent but the taste was amazing. This pizza also has pine nuts and the crust which was soft and Delish. We also tried their Fig & Feta Salad, Spaghetti Salsa Romesco, Pancakes Ripieno which was very delicious and amazingg in taste. We ended up our dinner with dessert called \" Warm Apple & Cinnamon Tart\",it was so yummyy and scrumptious. FRO will definitely recommend this place to fulfill your authentic Italian cuisine cravings.\n.\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n.\n#foodreviewonline #kailashshahaniofficial #india #foodstyling #food #instafood #foodpassion #foodphotography #foodblog #instagood #happy #instamumbai #food #foodie #mumbaifoodie #mumbailife #mumbaiblogger #mumbai_igers #blogger #miacucina #yum", "Mia CuccinnaRecently visited a continental level restaurant at Bandra Hill Road and i am very impressed.I was served by Tonton and she was very attentive at my table and made sure we were served on time.Also Mr.Ronny made sure everything was sure and came to our table to know the feedback about the place so that they make the place better. I tried few of the items and would recommend it to everyone as i have personally loved them a lot \u2022Kiwi Mint MartiniThis one had a little soury and sweety taste but had a good kick to the drink and would recommend it to all.\u2022Whiskey SourOne of the best whiskey sour i had till date. Made with perfection and a heaven to all the whiskey lovers out there.\u2022Salsiccia PizzetaFried pizza, chicken sausage & mozarellaPizza base fried and topped with chicken sausage and mozarella.Looked more like a mini pizza but tasted amazing and not like the typical pizza we always have.\u2022Spiedi di Gamberi alla grigilaGrilled prawn skewers with lime chilli mayoI loved the lime chilly mayo went so well with the Prawns. The skewers were amazingly made and was perfectly cooked.My favourite and the star of the day.\u2022Spaghetti aglio olio with parma hamSpaghetti pasta, garlic, chilli flakes & virgin olive oil.I love having aglio olio and i would never miss it at an Italian restaurant.For an extra twist i added a little more Virgin oil which made it more tasty and would suggest everybody to give it a try.The ham was delicious\u2022Pizza MeatyPepperoni, chorizo and chickenThin crust just the way i like. Good crispy pepperoni and some amazing chorizo.\u2022White cheesecakeThis was the hard cheesecake and would recommend it to all.Garnished with white chocolate this was a heavenly plate of desert", "Hmm... breaks my heart to write this review. I remember Mia Cucina when it started out in Bandra and they made their own fresh pasta and used top ingredients and flavors were amazing.To today, when the place looks great and food looks good, the quality of ingredients are totally compromised, possibly cost cuts on basic things like good quality cheese, pasta or tomatoes. While the service was good and place looked great in a fantastic location somehow it lacked flavors of good food. Wish they would bring back the original founder and original flavors and not try to cut costs to please masses, as that certainly doesn\u2019t seem to be working for the business. The restaurant was 90% empty at peak hours.Sad state... if the investors or business team is reading this : PLEASE DON\u2019T CUT COSTS ON INGREDIENTS ..\/ THOSE REALLY MATTER IN FINAL PRODUCT! Rather increase price if needed, people in Bandra can afford good food."],
