    "reviews": ["Lovely ambience, courteous staff, good food. I highly recommend.", "It was an \"OK\" experience at 55 east in Grand Hyatt. The food was very good sometimes and was below average. Also there was a lack of variety in the cuisines. I would really suggest the Hotel to may more attention to the restaurant add more variety into the cuisines. The overall experience of the hotel was also \"ok\" .  Kindly do add more variety to the cuisines and also the dessert needed some attention again.", "The restaurant is really lavish and offer variety in all aspects starting from breads to main course and the layout is really favourable. It will be busy at this period but staff makes sure that you get seated and get best service. Misil Pav is must try little different from what we get in Delhi.The food is mild and just a pinch of spice. Bhavini the server is efficient and staff like her matters a lot as one of the staff mishandled the cutlery and got fell over a guest and it could be a complaint but Bhavini took care of it professionally and rest is self explanatory.Being from hospitality industry these things matters to me a lot....coming soon Grand"],
