    "schedule_status": "Open now",
    "schedule_hours": " 11:00 PM - 22:30 AM",
    "reviews": ["LOVE. The salads, the vibe, everything!", "Good tasty healthy salad", "Why Visit :\nThe menu for Bombay salad company is any fitness lovers paradise. Set in the chic neighborhood of uptown Bandra, this place is great if you are into health foods or dieting. It gives you a full range of fresh fruit juices, smoothies and makes it yourself salads so that you can add whatever ingredients you want into your salad. The looks of the place are ultra modern and is a great place to chill out with friends.\n.\nOur Scores .\nLocation: 3.5 \nTaste: 5\nQuantity: 4.5\nPresentation: 4\nAmbience: 4.5\nHygiene: 4.8\nService: 3\nCost: 4\n.\nOverall : 4 \/ 5\n.\nBombay salad bar is committed to providing fresh, healthy, and clean food without compromising on taste. They just don\u2019t offer salads but sandwiches, juices, smoothies, tea, and coffee so that you get your dosage of a wholesome meal in one place. I loved the presentation, the impeccable taste and of course the options to choose from so many healthy foods which are just mind-blowing. However, We had few challenges with parking and service on the table whereby the food was not cleared from the previous customer in spite of flagging and server would simply dump plates on our table without even making eye contact or smile which made us feel unwelcomed. Overall this place has all the right ingredients when it comes to food.\n.\n#foodreviewonline #bombaysaladco \n#mumbai\n#mumbaikar \n#mumbaifoodlovers \n#mumbaifoodie \n#mumbaifood \n#mumbailife \n#healthyfood \n#salads \n#juices \n#sandwiches \n#keto #ketodiet \n#foodblogger \n#foodie \n#foodblogger \n#foodiesofmumbai"],
