    "reviews": ["Good food and space", "The tea salon in Bandra is a restaurant refashioned from a bungalow, which is our favorite kind of dining venue. The immense charm of the place is a result of the vintage detailing. Patterned tiles in striking blues are contrasted against ochre colored de-stressed walls. The tea menu has two pages dedicated to milky masala chairs and we opted for the ones with the most obscure ingredient mix: the Karipatta Delight (Rs.130) and the Malabari Vanilla Coconut Tea (Rs.160). The spicy and strong curry leaf-infused tea was closer to a home-made masala chai while the sweet coconut milk-based concoction tasted a lot like a tender coconut payasam. Apart from other fun milky teas (Parsi Mint, Kashmiri Saffron, Orange Blossom and more), there are iced teas, tea lemonades, chai lattes, tea smoothies and even filter coffee on the menu.\n\nAmbience : 5 \/5\nService : 2 \/ 5 ( Was literally waiting for people to serve, collect and clear)\nTea : 4.5 \/ 5 \nNibbles: 3.5 \/ 5 (Didn\u2019t live up to our expectations) \nConclusion: If you are a chai lover than surely visit them once and experience the way royals did it.\n.\n#tea #teacup #instatea #teaholic #teaaddict #mumbai #foodblogger #foodies #chai #staunchtraveler0807", "The tea salon in Bandra is a restaurant refashioned from a bungalow, which is our favorite kind of dining venue. The immense charm of the place is a result of the vintage detailing. Patterned tiles in striking blues are contrasted against ochre colored de-stressed walls. The tea menu has two pages dedicated to milky masala chai and we opted for the ones with the most obscure ingredient mix: the Karipatta Delight (Rs.130) and the Malabari Vanilla Coconut Tea (Rs.160). The spicy and strong curry leaf-infused tea was closer to a home-made masala chai while the sweet coconut milk-based concoction tasted a lot like a tender coconut payasam. Apart from other fun milky teas (Parsi Mint, Kashmiri Saffron, Orange Blossom and more), there are iced teas, tea lemonades, chai lattes, tea smoothies and even filter coffee on the menu.\n\nAmbience : 5 \/5\nService : 2 \/ 5 ( Was literally waiting for people to serve, collect and clear)\nTea : 4.5 \/ 5 \nNibbles: 3.5 \/ 5 (Didn\u2019t live up to our expectations) \n\nConclusion: If you are a chai lover then surely visit them once and experience the way royals did it."],
