    "schedule_hours": " 12:00 PM - 01:30 AM",
    "reviews": ["Good vegetarian options & great cocktails", " Hitchki is a Casual Dining restaurant and lounge located in First International Financial Centre, Bandra Kurla Complex, Bandra. The place offers a bright and sophisticated ambience and an exclusive menu serving a variety of Modern Indian delicacies. The premium menu is in line with the varied tastes and preferences of the people and caters to people of all segments. The eclectic bar menu offers an array of drinks and spirits to choose from.\n\nWhat we were served: Aao Kabhi Dabeli Pe, Mini Me, Paneer Ale Lababdaar, Teen Guna Schezwan, Jungle Mein Mangal, Chunari Ke Neeche Kya Hain and Johnny Gaddar\n\nAao Kabhi Dabeli Pe \u2013 Mumbai Vada Pav with Dabeli Masala Mix in besan batter fried like a vada and stuffed in buttered pav to garnish with curd, chutneys, sev like a delish chaat\n\nJohnny Gaddar \u2013 An amazingly high cocktail with coffee boba is the perfect drink to make it a wonderful night\n\nChunari Ke Neeche Kya Hain \u2013 White Rum, Dark Rum, Banana Puree, Strawberry make this unique concoction with dry ice fumes and chunari presentation\n\nMini Me \u2013 Mini naan kulchas stuffed and topped with lots of cheese\n\nJungle Mein Mangal \u2013 Black forest cake, Cherry, Dark and White Mousse, Chocolate Soil, Brick Popsicle, Milk Chocolate Sauce is the perfect dessert to end your meal with!\n\nTo sum it up, Hitchki is the perfect place for people to experience the nightlife. ", "Location: 002, First International Financial Centre, G Block, Bandra Kurla Complex, Mumbai\nCuisine: modern indian, fine dining \nAverage cost: 900 for two people (approx.)\nWorking hours: 12.00 pm \u2013 1.30 am\nDisabled friendly: yes\nOutdoor seating: no\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes until 6 pm\nVegetarian only: no\nJain food available : yes \nSmoking area : yes\nServes alcohol : yes\n.\nWhat we love here: \nMasala Pav ,Cocktails, Mocktails, Jumbo Prawns, Cheese Nachos, Bhut Jolokia Chicken Wings, Brownie Chocolate, Pav Bhaji Burger, Charlie Chapli Kebab, Crispy Chicken Khurana, PP\u2019s Risotto, Dum Biryani\n.\nWhy visit :\nIn light of the mouth-watering dishes and enticing cocktails presented in a retro-modern fusion setting, \u2018HITCHKI\u2019 is surely making a mark on BKC and its nightlife. So, relive the aromas from childhood kitchen with the perfect music setting the mood.\n.\nOur scores\nLocation: 5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbience: 5\nHygiene: 5\nService: 5\nCost: 5\n.\nOur review : 5 \/ 5\n\nHITCHKI BKC imbibe the nostalgic elements that made Hitchki\u2019s flagship outlet a walk back in time with quirky ceiling fans that have lights attached and wood paneled walls. With a chic diner ambience during the day that transforms into a buzzing party spot at night the outlets vibe is classic yet contemporary with vintage upholstered chairs and diner style seating, a mirrored wall and retro printed tables. Living upto its theme, the resto-bar takes you on a nostalgic trip with its exceptional ambience, quirkily named dishes and a unique serving style. The economically priced menu incorporates regional and traditional flavours from across India and offers classic favorites with modern twists. .\n#foodreviewonline #hitchki #bandra # bkc #mumbai #mumbaikar #mumbaifoodies #foodofmumbai #foodie #foodlover #restobar #restaurant #restaurantdesign #foodaddict #foodandwine #beer #wine #instafood #instamumbai #instalike #instagram #cocktails #chicken #goodvibes #mumbaidiaries #mumbai_ig #foodblogger #blogger"],
