    "schedule_hours": " 11:00 PM - 00:00 AM",
    "reviews": ["Excellent concept. Excellent menu. Sensitive service", "Creative combinations for healthy eating that is yummy too.", "SANTE SPA CUISINE - FOOD REVIEW ONLINE (FRO)\n.\n.\nLOCATION: BANDRA KURLA COMPLEX, MUMBAI\nCUISINE: SALAD, CONTINENTAL, HEALTHY FOOD, MEDITERRANEAN, PIZZA\nAVERAGE COST: 1800 for a couple (APPX.)\nWORKING HOURS: 11 am \u2013 12 Midnight\nWHEELCHAIR FRIENDLY: NO\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: YES.\n.\n.\nWhat we love here: Tomato and Brocolli Scramble, The Buddha Bowl, Asian Heritage Purple Riso, Virgin Coconut Oil Toffee, Thandai Milkshake, Salted Caramel Mud Cake.\n. .\nWhy Visit: A perfect place to relax and consume healthy, organic and super delicious delights guilt-free.\n.\n.\nLocation: 5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbience: 5\nHygiene: 5\nService: 5\nCost: 5\n.\n.\nOur Review: 5 \/ 5\n@santemumbai is located at the First International Financial Centre at BKC. They have a soothing and calm ambience with pleasing lime green lights good enough to lighten your mood. At the entrance, they have a station for detox water which is served with a slice of orange. We started our evening with \u201cShammi\u201d of Red Lentils, Tomato and Brocolli Scramble and The Buddha Bowl are all really appetizing in taste. Coming to the main course, Asian Heritage Purple Riso is just a perfect mix of vegetables who would have thought vegetables could be made so lip-smacking. Their Whole Wheat Spaghetti is a must-try because they have prepared it in such a way that it is healthy and not at all compromising on the taste. They offer a variety of unique healthy combination of beverages. We tasted their Hot Turmeric Latte, Thandai Milkshake and Holistic Juice and all of them tasted really good. Finally some healthy desserts, Salted Caramel Mud Cake and Virgin Coconut Oil Toffee are to die for..\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #mumbaifood #mumbai #mumbaifoodie #foodie #foodblogger #foodofmumbai #foodphotography #mumbaifoodies #mumbaifoodlovers #food #instafood #foodgasm #foodstagram #blogger #foodlover #mumbaikar #foodies #instagood #yum #spa #GlutenFree #vegan #glutenfree #healthyfood #healthy #healthylifestyle #instagood #santespacuisine"],
