    "reviews": ["Gateway taproom is located in the heart of BKC and is known for the best European food. They have a range of 8 to 10 constantly evolving beverages brewed at their brewery and a variety of cocktails.The white Zen beverage and Malta Orange cocktail are the favorites. The interior are casual and classy with inspiration from German gardens. Wooden benches, industrial high bay lights and a sprawling bar exudes an ambiance that is relaxing.They host live music nights ranging from 90's rock to upbeat retro from time to time, a must go to place any day of the week for some foot tapping music.", "Gateway taproom is a excellent place in BKC.If you are beer lover,then you must visit this place definitely.We had BBQ chicken tender with Belgian tripel beer.The food was excellent.Worth visiting again.", "Great drinks and amazing food!!!"],
