    "reviews": ["Cozy place, interesting food options", "A vegetarian place can't get better than Auber-gin.Was a bit skeptical before visiting since this was an all vegetarian place and quite far from home (Lokhandwala to Breach candy), the distance for vegetarian food would have never made sense had the food not been as good as it was. Simply marvelous! I started off with the Charcoal Nachos, the Charcoal Nachos are a signature adaptation of the general nachos here at Auber-gin. They have various Charcoal items on their menu, and that basically means that its black. In the nachos, the tortilla chips were charcoal black. Overall, the nachos were super delicious. The second item I had was the Cottage Cheese balls. These were exactly how you'd expect them to be. Fried goodyness! The next item was the charcoal Lebanese wrap, again, the wrap was signature black. The stuffing inside were falafels and hummus and it went extremely well together and was an absolute gem of a dish. For main course I ordered the Charcoal Spaghetti and the blue cheese pizza. Both of which again were fantastic. The charcoal spaghetti though was out of this world. I would highly recommend everyone to try out all the charcoal dishes on their menu as they're absolutely amazing. I would highly recommend this place overall because it's just too good. Especially to all the vegetarians out there. Keep up the great work team Aubergin, you're killing it.", "Overpriced for the quality of food. Ambience was nice. Service was good too."],
