    "reviews": ["Good but costly!", "One of my favourite destinations to celebrate my wedding anniversary", "The prices are not for a mid ranger. Liked the ambience and the decor. They try to ensure that the food is as authentic as possible. Have visited their outlet in Bengaluru as well. Those wall paintings and photos from the streets of the city of joy will get you soaked in the vibe of this eastern city. A nice place to hang around if you don't bother shelling out money. Enjoyed the Daab Chingri and a Bengali sweet. The food might not go well with the average Indian taste bud which is obsessed with spicy feast. But it is a welcome change to feast in on their offerings which goes easy on your tummy."],
