    "reviews": ["Nice ambience and very well made place. December weather was perfect to sit outside. The best part is to bring with a live demo of all menu and explain it nicely. Great place with expensive drinks menu.", " In love with this place!!!\nBeautiful ambience and the taste of the food was really authentic chettinad food.\nI tried Madras masala curry and Mutton korma with appam and malobar parotha????????????\nAnd for starters karaikodi prawns \u2764\u2764\nMust visit place!!  ", "TANJORE TIFFIN ROOM - FOOD REVIEW ONLINE (FRO)\n\nTANJORE TIFFIN ROOM - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Versova, Mumbai\nCUISINE: SOUTH INDIAN\nAVERAGE COST: 1300 for couple (approx.)\nWORKING HOURS: 12 NOON \u2013 1 AM\nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO .\n\nWhat we love here: Gun Powder Idli , Karaikudi Fried prawns, Kasturi\u2019s Puli Kilumbu, Paneer Chettinad, Chicken Stew, Coconut Rice.\n.\nWhy Visit: They have an excellent concept of a tasting thali, you can sample different curries and then decide which one to order.\n.\nLocation: 5\nTaste: 5\nQuantity: 4.5\nPresentation: 5\nAmbience: 5\nHygiene: 5\nService: 5\nCost: 4\n.\n\nOur Review: 5 \/ 5\nTanjore Tiffin Room is a quaint place to have lunch with conversation's and an equally upbeat place to wine and dine in the evening with good Cuban music, Tanjore Tiffin Room offers an experience that in our view is authentic in its truest sense. It has a pretty space with an earthy colour scheme and lots of greenery along with potted plants hanging from the ceiling. Coming to food, if you are visiting here for the first time, the server will introduce you to all the curries on a glorious platter in mini bowls; flavours ranging from the sourest tamarind flavour curry to rich Khorma gravy amongst a host of others. Then, you can choose whether you want to have fish, prawns, chicken, mutton or veggies in your choice of the curry. They have variations in rice too. Usually, this kind of cuisine is popular in smaller no-frills restaurants but this is a great place to enjoy a meal with your family. While it gets clubbed as a South Indian which it is, the food is more focused on Chettinad cuisine and dishes from Tamil Nadu. 'Chicken 65', 'Mini Gunpowder Idli\u2019s and 'Yam Cutlets' are a great way to start your meal. However, try their most recommended 'Rowdy Rasam', it is basically a 'Bloody Mary' with a twist of 'Rasam'. Awesome service makes this place a heaven for south Indian delicacies with friends and family.\n\nFollow @foodreviewonline or visit us on www.foodreviewonline.com\n.\n\n#foodreviewonline #kailashshahaniofficial #foodie #yum #versova #mumbai"],
