    "reviews": ["Cafe run by some awesome people", "It's a very very beautiful and cosy place right in Juhu. And plus they have wonderful home delivery service too. Must visit!", "Location: Juhu Road, Mumbai\nCuisine: caf\u00e9, fast food\nAverage cost: 250 for two people (approx.)\nWorking hours: 11 am \u2013 8 pm \nDisabled friendly: yes\nOutdoor seating: no\nValet parking: no\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes\nVegetarian only: yes\n.\nWhat we love here: filtered coffee, sandwich, cupcake, fries, chai, hot chocolate, salad.\n.\nWhy visit: created & served with a special touch by the differently-abled. A one-of-a-kind experience. Guaranteed.\n.\n.\nLocation: 4.5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbiance: 5\nHygiene: 5\nService: 5\nCost: 5\n.\nOur review: 5 \/ 5\nArpan has been set up by Yash Charitable Trust, with the mission of enhancing the quality of life of people with developmental and intellectual disabilities such as Down\u2019s syndrome and autism. Most aspect of the day-to-day running of the cafe like kitchen, service, upkeep are managed by differently abled individuals who operate in 4 hour shifts. They welcome you with genuine broad smiles, serve you with enthusiasm, take care of you with warmth and love, and bid you goodbye with an honest intent of seeing you again. The d\u00e9cor of this place is simple without any frills, yet welcoming. The turquoise and white walls exuded a very happy vibe and the framed photographs of the staff captured in beautiful moments depicted exactly what the place stands for; a strong ground for the differently enabled to showcase their potential. Coming to food, Videshi Vada Pav, Raste Wala Sada Sandwich, Garlic Bread with Cheese and the Falafel Tikkies are some of the most chosen food here. Overall it\u2019s a place where you not only get good food but you also get a sense of motivation by seeing the positive vibes and environment everywhere.\n.\n.\n#foodreviewonline #kailashshahaniofficial #cafearpan #mumbailocal #mumbai #bnw #mumbaikar #india #mumbailife #photography #mumbaidiaries #mumbaicity #streetphotography #igers #mumbaispecial #mumbaiphotos #mumbaiindians #mumbaiinstagrammers #mumbaicststation #mumbaistreets #gram #mumbaiphotography #indiaphotosociety"],
