    "reviews": ["We went for a office party. Its a nice place to go for drinks. Good crowd during the weekends but a bit small place for a huge group.The only con is that food ain't so great.", " This place is one of the most amazing restaurants in Mumbai. The ambiance is amazing and food is mind blowing. Every dish here is just so delicious. I have tried spaghetti, pasta, pizza, chilli Paneer, onion rings, jalape\u00f1o cheese cigars, Reggae reggae nachos. Everything is super mind blowing.\nIn drinks try Garage special fruit punch. And in desert try cookies dough with chocolate chips and marshmallows.\nThe staff here is also very much friendly and corporative. This is must go restaurants in Mumbai.  ", "Being on a tuesday night for dinner,they had a karaoke night. The crowd was really good and involvement in the karoke was perfect. The food was amazing,they had really good variety for food and also for cocktails and mocktails. The ambience was really good. The food I ordered are:-\nMocktails and cocktails:-\nKala Khatta Beerita: It was a different kind of cocktail with a mixer of kala khatta sherbat and beer,which was amazing #musttry\nBerry Blast: mocktail which had a base of berry and it was in the form of slush which made it unique and great to try on\nStarters:-\nPaneer 65: It was the perfect starter to start with spicy and softness of panner and the veggies mixed in were perfect\nPao Bhaji Tartlets: baked biscuit like shape with pao bhaji mixer and mozarella cheese on top which is served with green chutney.\nFalafel Bao: falafel bread was really soft and fluffy which had a hara bhara tikki in the bread with veggies and hummus in it.\nMain course:-\nMakhani Fondue: The only mains we tried was makhani fondue which is sufficient for more than 3 people. It had barbeque of baby corn,panner,brocolli,veg kebab with the daal makhani in the middle. Also it was served with garlic naan. #musttry\nDesert:-\nBlueberry Cheesecake: perfect desert to end with cake was amazing and perfectly baked with the blueberry sauce on top which was not too sweet.\nCookie Dough: served in a hot plate of choclate cookie dough with marshmallows on top also a scope of vanilla ice cream in the middle #musttry.\n\nOverall the staff was really great. Place was reall good to hangout with friends and family."],
