    "reviews": ["Awesome place to hang with your friends or family..  We visited there on Tuesday night.. after visiting two lounges in kamala mills i found younion the best one.. n we decided to stay there..They were  Playing latest Bollywood tracks.. we rocked the dance floor n had superr fun.. food was good too.. happening ambience with happening crowd all over.. Ll visit again soon.  From my side", " HAD A BLAST HERE,@DIWALI BASH,all my cosins(17)enjoyed fully ,service,was too good,music suprrb ,food items suprb,overall a fantastic eve,space was a issue but got it solved in sometime,tx mr Glen. will surely visit on another big day.???? ", " YOUnion is a place which just shows you how far innovation can take you. When everyone was experimenting with craft beers or artisan cocktails. These guys came up with unique shooters. Shooters which will guarantee you one hell off a Tipsy Turvy Night. The crowd here is unparalleled may it be a weekday or a weekend.\u00a0\n\nI tried a host of their dishes. I started off with a Chana Koliwada which is a very unique \u201cChakna\u201d the spicy koliwada marination to the chants make sure you will be in the awe of it\u2019s innovation while you are gulping down the drinks.\n\nThen we went in for their Veg Tandoori Momo\u2019s again something which was spot on especially with the dips\/sauces and their in-house special marination. It was just spot on every bite.\n\nWith the tipsy cocktail we started off by hitting a Smoked Skull Manhattan. Which was bang on with a whisky of bourbon and a martini rose in along with a citrus punch it was perfect to get you spirit high up and running.\n\nThen we went on with their wild mushroom momo which were another wonderful piece of art. Button and shiitake mushrooms were shredded to give you a unique savoury tasting dim sums which were second to none.\n\nThen we tried a hand at few of their shooters. Namely\n\nBlue Ice: A blue cura\u00e7ao and vodka based shooter.\n\nCherry Vodka: I guess the name is enough\n\nDeath By Job: Coffee Liquor, Bailey\u2019s, Chocolate Liqour and what else do you need.\n\nDeep Blue Sea: How do you fancy a tequila with Blue Curacao.\n\nA Keto Chipotle Bowl was a spot on dish which was just killing it round about. The beans were exquisite and went in well with the rice.\n\nFinally, we ended the meal with a stellar Caramel Cheese Cake which was the eat and indulge for me. The beautifully crafterted and wonderfully curated Cake was truly a state of art which will leave you in its spell forever. "],
