    "reviews": ["Good food. Good service. Cozy place", "This team is doing unforgettable work, you visit and you talk to lots about experiencing it, right from their ambience\/serving dishes\/menu\/service etc you will be having a wow moment.....A must visit for sure", "TAMAK - FOOD REVIEW ONLINE (FRO)\n\nTAMAK - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Santacruz West, Mumbai\nCUISINE: North Indian\nAVERAGE COST: 1200 for two people approx\nWORKING HOURS: 7 AM to 11:30 PM\nWHEELCHAIR FRIENDLY: YES\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO\n.\nWhat we love here: Truffle Essence Mushroom Cheese Kulcha, Dilli's Bhalla Papri Chaat, Makhan Samudri Taj, Ker Sangri, Punjabi Kadi Pakoda & chawal, Butter Chicken, Nihari gosht, Kala Chana ka Halwa,\n\nWhy Visit: This tiny eatery with only an outdoor, limited seating, boasts of aesthetic d\u00e9cor and a cheerful vibe.\n.\nLocation: 4\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbience: 4.5\nHygiene:5\nService: 5\nCost: 5\n.\n.\nOur Review: 5 \/ 5:\n@tamakrestaurant is a small quaint restaurant in santacruz serving north indian food. A highly underrated, hidden gem in Mumbai. This place is bit small in terms of size but compensated for it being fantastic. Plenty of natural light filtering in, which enhances the design elements in yellow and blue. The small kitchen from where Chef Vikram Arora, bustles in and out with dishes, looks intriguing. The staff is courteous and active. Coming to the food, we started with amazing truffle mushroom cheese khulcha. It has subtle hint of chives and sea salt and dash of truffle enhanced this dish. We also tried appetizers Dilli\u2019s Bhalla Papri chaat & Palak & paan patta chaat. For non-vegetarians they were served varieties of dishes. Makhan samudri taj and Nihari gosh were top \u2013notch. We also taste ker sangri & Punjabi kadi pakoda with chawal. Moving on to the dessert we tried Kale Chane ka halwa it was scrumptious and unique. Overall we can say if you are looking for north indian cuisine serving at affordable rates this is the place for you.\n\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n.\n#foodreviewonline #kailashshahaniofficial #northindian #cuisine #india #foodstagram #foodstyling #love #photography #food #instafood #foodpassion #foodphotography #foodblog #foodiegram #instagood #happy #instamumbai #food #foodie #mumbai #mumbaifoodie #mumbai_igers #mumbailife #mumbaiblogger #yummy #blogger #tamakrestaurant"],
