    "reviews": ["Fantastic food and ambience. Lovely people too", "The servers were incredibly sweet. There was some live music ...and that was moving and soulful. A  restaurant overall was really warm and friendly and really accomodating. Would definitely recommend it.", "*The Harbour Bay - SeaFood Kitchen & Bar*The place is this place is quite amazing at the first look.Which place is also visited by many celebs.The places having a beautiful sitting area and also the Vibes of the place is beautiful.They have live singing which was quit pleasent while enjoying the food.They serves SeaFood, European, Asian, North Indian, Lebanese, Salad and Bar Food we tried out: *Soup*#Cornfed Chicken SoupDiced chicken and flavorful soup*Appetizer*#Sweet Chilli ChickenJuicy chicken pieces and sweet chilli sauce. The flavour was quite delicious#Olive NaanNever seen naan with olive#Green Chilli PrawnsDilicious prawns covered with  chilli paste . The spice flavour will take a bit time to heat up your mouth.*Main Course*#Veg Ceylon Stew with coconut   riceThick creamy stew had french beans and sweet potato with coconut rice was the best companion#Crab in Harbour Bay style Sauce   with Egg Fried RiceSuper delicious crab meat & amazing flavorful sauce with egg fried rice was great companion.*Dessert*#Chocolate PastryFluffy chocolate pastry drizzled with chocolate syrupIf I talked about the food it was absolutely amazing and flavourful, the service provided was also very nice.I don't think so there is any suggestion I would say because I spent a really good time here.I am happy with the experience I felt in here.Thank you for your kind service @the harbour bay I hope to visit this beautiful place again"],
