    "schedule_status": "Closed Opens at 18:00",
    "reviews": ["Good place for partying", "You all are the most badly run restaurant. After confirming the reservation you cancel it. How unprofessional. Just because you have a party reservation. And this was a special wedding anniversary celebration for me. I am so happy you cancelled because I would hate to be in such a horrible place. This is not my first experience with you but", "ESTELLA - FOOD REVIEW ONLINE (FRO)\n\nLOCATION: Juhu, Mumbai\nCUISINE: Asian, European, Seafood\nAVERAGE COST: 2500 for couple\nWORKING HOURS: 6.00 PM to 01:00 AM\nWHEELCHAIR FRIENDLY: YES\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO\n.\nWhat we love here: The Beach Avocado salad, Estella Raspberry Souffle, Chocolate & earl torte, hong kong stir fry noodles veg, Teppanyaki styled tofu Mushroom & quinoa bites ,Ravioli .\nWhy Visit: The beachfront restaurant in Mumbai that serves up an enviable sunset view.\n.\n.\nLocation: 5\nTaste: 4.5\nQuantity: 4.5\nPresentation: 5\nAmbience: 5\nHygiene:5\nService: 5\nCost: 5\n.\n.\nOur Review: 5 \/ 5:\nHelmed by the same bunch behind Radio Bar and Silver Beach Caf\u00e9, @estellamumbai is a modern Australian restaurant in Juhu Tara road. The d\u00e9cor is clean with minimalistic details and gives off a futuristic feel with dark marble tabletops and warm wood accented slats. Dim lighting creates an intimate vibe, perfect for date nights. An impressive island bar connects the inner seating area to the open deck, which offers a sweet view of sunsets and the Juhu beach shoreline.The menu combines Australian cuisine with Asian influences and is quite extensive in its offerings. We started our meal with ravioli of spinach which was small pasta envelop containing spinach, with ricotta cheese and pickles sauce. It was aromatic & flavoursome. Asian Tacos was pretty good,it was stuffed with stir fry spinach cashew and soba noodles. We also tried beach avocado salad, Hong Kong noodles, teppanyanki tofu mushroom & double baked mini goat cheese souffle which was scrumptious. Overall FRO totally recommends this place for a romantic dinner with seaview. .\n.\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #healthyfood #food #healthy #healthylifestyle #foodie #instafood #fitness #vegan #healthyeating #health #foodphotography #yummy #foodblogger #foodlover #breakfast #delicious #foodstagram #beachbar #bythebeach #bythesea #bestofmumbai #juhu #underthestars #sunset #lounge #nightlife\n.\n.\n@hiteshkeswani_official\n@twinklekeswani\n@nikhilmerani\n@chefrvmahabal"],
