    "reviews": ["I love the coffee here. They have one of the bestest coffee in Mumbai. If you're a coffee lover, you will know the moment you take a sip of their coffee.  Not too great to work here though coz the place is quite small and it's usually crowded.", "Bad need my refund", "Delight for serious coffee enthusiasts, Blue Tokai caf\u00e9 is a place where brewing a cup of coffee is a calibrated procedure executed by learned hands with freshly ground coffee varieties from estates across the country.\u00a0The menu is tiny and comprises croissant, granola bar, cruffin and more. And for the ones looking for the coffee menu, there\u2019s not one but two coffee menu \u2013 one for cold brews and one for hot brews. Expect your regular espresso shots, cortado, americano, mocha, cappuccino and for cold brews, there\u2019s iced espresso, iced latte, affogato coffee tonic and more. They also have a mini tasting menu, ideal for those who want to try a range of their coffees but don't know where to start. It has a range of brews that are sure to leave a mark.\n.\n#foodreviewonline #coffeeshop"],
