    "schedule_status": "No info on opening hours",
    "reviews": ["Reviewing Pepper and pint juhu.They've got an amazing ambience, attentive staff and quick table service.The dishes i had were-1)Spicy guava zing- Guava juice with masala on the sip area and filled with pomegranate.Great for refreshment.-4.5\/52)Elderflower elegance- I loved this very much but after the drink was half over the taste faded and it tasted bland and not so tasty.-3\/53)Cheese chilli tandoori Paneer roll- 4pieces in total in which \"cheese chilli\" was rolled into a paneer sheet.The paneer sheet was great and tasted amazing and even overall it tasted great but the stuffing didn't taste much cheesy.The stuffing was grainy and didn't feel up to the mark.-4\/54) Kerela style Pepper Fry tacos- With a roti base for the taco and topped with lettuce and chicken gravy which was peppery in taste and fried with curry leaves.These were then topped with mustard sauce.Tasted absolutely delicious and definitely my favorite dish from this restaurant.-5\/55)Butter Chicken Lasagna- The butter chicken was great and tasted absolutely delicious.But the lasagna sheets were limited and it was like having just the gravy half the time without the roti.Would prefer if they had more lasagna sheets and bigger ones covering the whole area.And the cheese was also limited.-4\/56)Rasmalai Tiramisu- A unique dish which I had never seen before.Layers of Rasmalai and tiramisu cream as a dessert is definitely a unique dish.It tasted great and I loved it really.Since I like tiramisu and Rasmalai both and their combination literally had my heart!-5\/57)Blueberry creme brulee- Classic creme brulee with blueberry pulp on the bottom and the top.Tasted delicious!Served with a Shrewsbury biscuit.-5\/5", "The Pepper n Pint is a warm n friendly place with excellent food . A place where u always know u will get the best of everything to eat and drink .The place is located at 2nd floor of Horizon Hotel, Juhu Church Road. It is easy to locate(can rely on Google Maps). Ambience ~ The entrance of the restaurant is very unique. They have Indoor seating arrangements with beautiful lighting and soothing music.The Place is huge and has the Capacity of around 95-105 people at once.They have a Live Sports Screening and Smoking area.The indoor features a cozy dining room and comfortable furnishing and decor with soothing warm tones and music . \u2022\u2022\u2022\u2022\u2022\u2022\u2022\u2022What all we tried : \u2022\u2022\u2022\u2022\u2022\u2022\u2022\u2022Started off with Thai Orange Mojito and Spicy Guava Zinc ,which was just awesome The Flavour, Consistency, all of it was wonderful.Then we tried their Asian Style Devil Chicken (Highly Recommend.!! ) and Butter Chicken NachosWe had Chicken Biryani which was very good, the chicken was nicely cooked and it was tasting delicious.Butter Chicken Lasagna ~Presentation was goood but the taste was even better.In Dessert we had Rasmalai Tiramisu which was justtt lit (must try)All their food is amazing especially Asian Style Devil Chicken, Butter Chicken Lasagna.Everything we had was delicious , fresh and beautiful presented . Dishes were unique and tasty with Amazing quantity ,we enjoyed the music and ambience while having food.~The service was bit slow but the taste of food compensated for it.~Thank You ! Will Visit Again Soon.Highly recommended.!!!!!", "Good food....good music"],
