    "reviews": [" Mayur was very kind and helpful ... he helped us to select the dishes ... also recommended a few which were very good ... we had a wonderful evening ... my son who\u2019s a connoisseur, really loved the lotus milkshake and also the lotus drama in the desserts ... overall experience was wonderful ... thank you Mayur for making our experience so enjoyable !!! ???????????? ", " Bayroute, the lavish fine dine Restaurant which serves the best lebanese, turkish & greek cuisine in the town. It was my first time to Bayroute\u2019s newly opened branch at Palladium & i must say had a super Royal experience from the ambience which gives perfect middle eastern feel to the courteous staff which was very helpful.\n\nThere is big list of mouth watering items in food category. Here are few would like to share\n\nMocktails\n1. kale & Avocado Juice 5\/5\n2. Reyhan 4\/5\n3. Lime & Mint 5\/5\n\nStarters\n1. Bayroute Hummus 5\/5\n2. Kale avocado salad 5\/5\n3. Labneh zatar manakeesh 4\/5\n\nDessert\n1. Baklava 5\/5\n\nWould highly recommend..!!! ", " Always been a fan of this place since its very first outlet in south mumbai.\nDecided to pay a visit to this recently launched outley in palladium mall.\nThe ambience is lit and the staff is helpful and courteous.\nComing to food:\nI tried-\nHummus bayroute\nKuzu\nLavash crust kebsa rice\nChicken tadharj\nQuwarmah\nKebab koobideh\nChocolate fondant and\nLotus drama.\nmocktails:\nReyhan\nAleppo chilli guava,\nTurkish kale\n\nThe food was delicious like always and we totally enjoyed our dining experience yet again.\n "],
