    "reviews": ["TALLI TURMERIC - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Worli, Mumbai\nCUISINE: North Indian, South Indian, Mughlai\nAVERAGE COST: 1500 for couple (approx)\nWORKING HOURS: 12.00 pm - 1.00 am\nWHEELCHAIR FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nJAIN FOOD : YES\nVEGETARIAN ONLY: NO .\n.\nWhat we love here: Urugai Idli Vathakal, Kongumadu Podi Dosa, Malabar Theeyal, Kozhi Chettinad, Tandoori Shakkarkand, Karnataka Sagu, Crisp Hot Jalebi With rabdi\n.\n.\nWhy Visit: Mumbai restaurant Talli Turmeric is a tribute to the golden spice in our kitchen.\n.\n.\nLocation: 5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbiance: 5\nHygiene: 5\nService: 5\nCost: 5\n.\n.\nOur Review: 5\/ 5:\n@talliturmeric, India's only turmeric-centric has launched at Atria Mall, Worli, Mumbai. A nouveau restaurant that embodies the beating heart of India. The first element of decor that will catch your eye is the symmetric pattern created on the outer facade of the eatery using terracotta roof tiles. The multiple seating areas are well-laid out and the earthy hues, lend a warm touch. This tastefully decorated restaurant with contemporary design elements and a snazzy showpiece bar lays equal emphasis on food. We started our meal with appetizer Tasty Urugai Idli, its a kanichipuram idli tossed in tangy spices and gunpowder. We ate Kongumadu Podi dosa its a traditional crisp dosa with kongamadu masala. In mains we had Malabar theeyal an old classic kerala dish includes roasted coconut and blended spices. It tastes healthy and tasty. The Crisp Hot Jalebi with Rabdi made by the Halwai were delightful desserts that will leave you in dessert coma. .\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #mumbaifoodie #mumbai #foodgasm #mumbaifood #foodie #food #foodtalkindia #things #foodporn #indianfood #foodblogger #foodphotography #mumbaikar #doinmumbai #foodstagram #mumbaifoodblogger #mumbaifoodlovers #mumbaifoodies #mumbaistreetfood #foodies #somumbai #foodofmumbai #instafood", "I love the complete ambience, it was so lit with wonderfull light effects of bulb .The ambience was much spacious. Not only the ambience but also the food was upto the mark. It have classy cocktail session too.They served us their welcoming drink turmeric latte which have high medical values of turmeric and gingerWe tried Spicy Guava and Aam Panna in Moctails. Both were chilled,cool and soothing in taste. Spicy Guava was having proper punch of guava and pieces of lemon and ice cubes. The glass was having spices which were spicy and sour in taste on its edges.Aam Panna was a regular mango drink served with mango punch and ice cubes.Seekh Kebab and Tandoori Prawns was served as starter.Seekh Kebab was a mutton kebab with perfect amount of spices as well as it was served with mint chutney.Tandoori prawns one of the unique dish was served with long prawn marinated and steamed in tandoor. The chutney served as well as the chutney present in the platter was adding to its taste more.In main course we tried Malabar Paratha which was much soft and yum with appropriate oiling and Kozhi Chettinad which is a spicy chicken curry with great taste and quality. The chicken is soft and well cooked.Coming to the desert the most famous desert dish of india Jalebi was served with chilled rabdi. Can say one of the best combination of desert. The rabdi was much sweet but balancing the dish Jalebi was in proper sweet taste.My overall experience at this place and staff was beautiful. And can suggest a best place for chilling as well as spend quality time with your food. Do visit.", "Good place, quick serving."],
