    "reviews": ["One of the best Thai Food", "After dining here, it's easy to see why this place is known as the best Thai restaurant in Mumbai. It has an electric atmosphere and of course, fantastic food. As we were guests in the hotel we were given complimentary drinks and desserts which was a nice touch but, you can see why so many non-hotel guests come to eat here. The open kitchen lets you see the fresh food being cooked up for you. Definitely make sure you get a reservation- particularly on a weekend!", "Loved the ambience, Beautiful interiors! Best Thai food served!!"],
