    "reviews": ["MILLENNIALS EATERY & BAR - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Fort , Mumbai\nCUISINE: Italian, Continental, Pizza, American\nAVERAGE COST: 1500 for couple (approx)\nWORKING HOURS: 11.00 am - 1.00 am\nWHEELCHAIR FRIENDLY:\nOUTDOOR SEATING:\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nJAIN FOOD : YES\nVEGETARIAN ONLY: NO .\nWhat we love here: Millennial veg burger, Vegetable Cannelloni, Blueberry Pancake, Millennial Special Sizzler\n.\nWhy Visit: Vintage Decor & Rustic Look With Millennials Eatery & Bar .\nLocation: 5\nTaste: 4.5\nQuantity: 4\nPresentation: 4\nAmbience: 5\nHygiene: 4.5\nService: 4\nCost: 4\n.\n.\nOur Review: 4 \/ 5:\n@millennialsmumbai is the latest addition to the busy by lanes of Fort. This all-day, casual eatery offers a vibrant, yet comfortable ambience that transforms to a buzzing pub at night. When we visited we fell in love with the super artsy interiors, walls adorned with paintings that take you back to another era and that are inspired by the art and cultural capital of the city \u2013 Fort. The vibe of the cafe is very relaxed with its distressed walls, pops of colour, paintings and completely miss matched furniture making it what the kids would call a cool instagramable place. Coming to the F&B, we started with Quinoa Bhel which was ordered with tons of recommendations and after few bites it clearly missed our expectations. Next was Shakshuka which was simply lip smacking and if you have traveled extensively you would know its not easy to get this right so kudos to chef. After that lovely dish we wanted something that would match the momentum and Cajun spiced Zucchini fries clearly won in this department. We would also like to recommend their signature burger and for desserts blue berry pan cake.\n.\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n.\n#foodreviewonline #kailashshahaniofficial #india #foodstagram #foodstyling #love #photography #food #instafood #foodpassion #foodphotography #foodblog #foodiegram #instagood #happy #instamumbai #food #foodie #mumbai #mumbaifoodie #mumbai_igers #millennials #mumbailife #kalaghoda #fort #colaba #mumbai #foodporn #mumbaifoodie #foodblogfeed", "Can never go wrong in this place with what you eat. Friday nights are crazy with Bollywood music and live singer on Thursdays", "Amazing place to be at... the food and drinks with lovely music to dance to ...such a lovely night with friends ... gonna come back soon"],
