    "reviews": ["family dining, drinks, okay music", "nice place ???? to go n refresh mine", "Its bar on the Ground floor and First floor is only reserved for couples which converts into dance floor. Music with Live matches is what you can look for.\n We devoured on:\n Strawberry Banana Milkshake- It was a perfect blendy of two frutiy flavours.\n .\n Kitkat Milkshake- Less sweetened just the way we like but it has scope for improvement.\n .\n Crispy chicken- Finger like chicken crispy outside with a spicer note.\n .\n Kebab Plateer- Six different varieties of Kebab each different and succelent to try for served with veggies and green chutney.\n .\n Chicken Kadai- A mughlai gravy with pieces of chicken served with their glutonous Garlic naan.\n .\n Sizzling brownie- This was the show stopper of our Night. Thick brownie with a scoop of vanilla poured with chocolate sauce to sizzle.\n I am definatly coming back for the food."],
