    "reviews": ["Food was terrific, very well prepared, and presented. A must-go place if you want to try Mexican. The place does get crowded, reservations are recommended on the weekend.", "One of my favorite cuisines is Mexican and always up for it when given an option to choose. On my way back from office is when I decided to stop by Khar for Poco Loco at Khar S.V Road, one can easily locate this on maps. Restaurant is divided into two sections, one with the bar as soon as you enter and the other side you need to walk through a passage. You will be entertained through your meal with some fabulous Latino music. Place serves Spanish, Mexican and Continental dishes.\u00a0The walls are done well, one side there is a quote - According to Chemistry Alcohol is a Solution. On the other side all the drinks have their Initials highlighted, just seems like chemical formulas. All these formulas are highlighted in different colors and it has a legend besides it stating whether the drink is a classic or shooter or margaritas, etc. Also there are some special Mexican or Spanish drinks one can try.Talking about what all we tried at Poco Loco -We started with few appetizers or small bites from Bocaditos menu - Cazuela De Setas, Patata Bravas, Toastada Mexicana and Avocado Bruschetta. I would personally recommend all the dishes in the same order. Cazuela De Setas was sizzling portobello mushrooms (on a hot plate, be careful) with cayenne chilli and garlic and canarian mojo sauce. It is a must have for all mushroom lovers. Just loved the dish. Comes along with bread loafs, apply the sauces on the loaf and loaded with the mushrooms. A treat, cant be missed.\u00a0I also loved the Patata Bravas as well, topped with brava sauce and sour cream. Goes perfectly with your drinks. Toastada Mexicana is topped with salsa and sour cream again, on the spicy side for sure. With Mexican food, you are bound to find few dishes quite spicy.\u00a0From the mains Segundos section - we called for the Burrito Bowl. Its quite interesting that it is DIY Burrito Bowl. Everything is given separate to you - brown rice, veggies, salsa, sour cream, guacamole and a wrap. So you may choose to fill everything in the wrap or have as a bowl. I loved the taste of this burrito, definitely worth a try. And you choose the way you want your burrito.Last but not the least, from desserts wanted to try the Tres Leches however it wasnt available. The next option that we chose was the Chocolate Chilli Pepper Tart - an eggless preparation. An amazing combination of both sweet and spicy especially towards the end. Beautiful presentation as well.\u00a0A good evening spent, good experience, happy to have tried this restaurant. Worth visiting. On my next visit, shall be trying out remaining dishes like Chimichurri, Chimichanga and Enchiladas.", "Amazing food, food presentation is really nice, Great staff, service is fantastic and a must visit :)"],
