    "reviews": ["Ambience is good. Food portions could be a tad bigger and waitstaff a tad more attentive.  But all in all, a pleasant experience", "Good placeOne of the best desert had so far #recommendedGood crowdAmbience 5 \/5They serve middle eastern cuisine", "First and The For most thing is that I fell in love with the ambience of this place while I was here a month back ...... Apologies for writing the review so late . I was here with my couple of friends and tried out couple of great delicacies over here.We had the following of dishes.\u2022 Baharatli Hummus (5 \/ 5)\u2022 Bay route Hummus ( 5 \/ 5)\u2022 Ispanak Mantar ( 5 \/ 5 )\u2022 Fatar Baklava ( 4.5 \/ 5 )\u2022 Baklava Shake ( 5 \/ 5 )\u2022 Koshari ( 5 \/ 5 )All of the dishes were amazing and exhibiting some great effort and that lip-smacking touch of grace to it . Loved the decorative garnishing of the Fatar Baklava .I am a food blogger by far, Had a wonderful time drooling over the restaurant's beauty also your restaurant staff is much friendly and co-operative.Would love to be here, Once again in a lifetime."],
