    "reviews": ["Good food and ambience", "This place perfect if you want to hangout with friends or want to go with family. This place has a superb ambiance with poor side dinning.For ambiance-9.5\/10We had a warm welcome from receptionist. Service was also good and fast we hardly waited for the dish. Dishes was beautifully persented. The ambiance screams royalty. Its so comfortable you can spend hours hereFor staff & service- 10\/10All the dishes were well prepared and equally delicious. I recommend you to visit here for sure.We had,DRINKS\u2022 Watermelon detox \u2022 Freshly screwedFOOD\u2022 Prawns tikka \u2022 Chicken ghee roast\u2022 Pull apart garlic bread \u2022 House Pasta", "If you are planning for a Dinner by pool side with your loved one then Oheka is the place.You get to see people swimming one side and dinning on the other side.Staffs are very pleasant.Also what I had found unique is that they also serve sugar free drinks.Now since sheesha is legal in Mumbai you will also people making smoke rings around.Quality and Quantity of food is also very good and definitely a 5 star rated restaurant.What we had ?Cocktails :Citron Melon Slush - Brazilian ConnectionCurry Veypila pour -Budding Rose Starters :Peri Peri Chicken popcornChicken Ghee Roast -Chermoula Chicken skewersMains :Butter Chicken with Roti Dessert :Almond and Berry"],
