    "schedule_status": "Closed Opens at 12:30",
    "reviews": ["C R A F T B A RLocated at bkc, near chetna College. Bandra East.Visited craftbar with my college friends for a small party. And here is my Experience with them.Food- the Food was of great quality and quantity. The food was served properly.Ambience - they have a inner as well as outdoor ambience. They have a lit bar inside.Service- the service was quick and the staff was prompt.We orderedNojitoIt was a lime based drink same was Mojito. It was refreshing and freshly made.Fruit punchIt was having flavors of pineapple, mango, orange, raspberry. The taste was awesome it was sweet and tangy. With vanilla cream.PassionateIt was a tangy drink with cranberry flavour it was tangy and sweet. Crispy potatoes They were round peices of potatoes tossed in honey and tomato sauce. They were crispy and crunchy. Loaded NachosThe nachos were in good quantity. Enough for 2-3 people. Nachos were topped with cheese, beens and mayonise. It was tasty. Egg kejriwal It was a round bread inside that there were some cheese sauce and over it. It was a omelet. The taste was good. Paneer Makhani The gravy was thick and a bit sweet. The paneer in it was fresh. Goes well with roti. Dal khichdi The dal khichdi was best of all. It was flavorful. The taste was just awesome. Loved it. Rasgulla birdnestIt waa small rasgulla's served with some rabdi on small tarts of sev. The rasgulla and the rabdi was sweet and tasty. And the tarts were hard. Flambeed Kala Jamun It was Rum over the kala Jamun and then it was lited. It was some thing unique. The taste was was fine. Overall the Place is cool and party lovers must visit this place. This place is always crowded with officers and young crowd. I recommend you to visit this place for sure. Food-5\/5Service-5\/5Ambience-5\/5", "Live GIGS AWESOME FOOD. Bit costly", "Where do I begin? I found out about this place from the lead singer of the Staircase Banned which plays every Saturday, and slays it....! We had matched on tinder and he  kept sharing these event details and one fine evening I said, let's go check him out...:) And that's how I discovered this place. The staff is extremely helpful...shout-out to Pooja she's an angel! The food is mind-blowing and the chef's do like to experiment... Kasundi chicken is the closest thing to food heaven I've ever gotten. The people who come there are all 90s babies and that makes the place even more lively because everyone is on the same page and love the music that the band plays. I've had fond memories of this place and I'd recommend it to all a  %!"],
