    "schedule_status": "Closed Opens at 19:00",
    "reviews": ["5th July 2019We joined in the 12th Anniversary celebration of one of Sahara Star's crown jewel resturants named Mabruk serving a vast array of delectable Mediterranean cuisine.Chef Jayed from Lebanon and his team laid across a platter of colourful and mouth watering dishes featuring a wide variety of meats, mezze platter dishes and the traditional Hummus. All dishes packed a flavourful punch with just the right amount of middle eastern which some say is an acquired taste.The evening started with starters like Laham Meshwi (Lamb), Qarrid (Prawns), Chicken Shashlik, Falafels and the like doing the rounds. The chicken Shashlik was the best of the lot and blew our minds away.In the main course although there were plenty of options to choose from including Morghabya Dajaj (Chicken Dajaj, A traditional preparation of Chicken boiled along with Chickpeas and Cous Cous), Siadih Samak (The most mouth melting fish in a semi gravy preparation of strong middle eastern flavours) and the like, the highlight of the evening was definitely Kharoof Mahshi which consisted of an entire lamb being oven roasted overnight post marination and served on a delectable bed of minced rice and veggies.Desserts were equally special with almost every dessert being different ranging from your traditional Baklava to Umm Ali (A preparation of Rice and Milk similar to traditional Kheer) which simply sent foodgasms down your spine.All in all a wonderfully spent evening and one which we would love to re-live again someday!", "The spectacular ambience which is breathtaking and the live music with delicious food! A perfect dinner date setup and also a good time with family and friends..The places serves sheesha and the fragrance is super powerfulWe had a beautiful seating just by the water. The staff is extremely courteous and the service is quick.We started off with :1) LEMON MAA WARDAThis is an extremely refreshing drink. The appearance is in a margarita style glass. Lemon juice with strong punch of mint, little sugary and salty. Very nice!2) KOSHAFThis is a mango puree style drink. Thick mango pulp with the tanginess and sweetness which goes well with the cold Mezze Platter3) COLD MEZZE PLATTERThis consisted of fresh hummus(made with chickpeas), fattoush (thick yoghurt based paste with spices sprinkled, was a bit too sour for my liking), moutabbel (made with eggplant and topped with some pomegranates), muhammara (walnut based thick crumbly paste)4) HOT MEZZE PLATTERB Jibneh Manakeesh is a mini pizza style made of flatbread topped with cheese and Zatar spices and veggies,Safiha b Jibneh is the best one which is a stuffed with mozzarella cheese and topped with zatar spices. There was Falafel which is the best I've had till date, Crunchy and crumbly.Soft and fresh pita breads served along!5) BAKLAVAThis is phyllo pastry sheets stuffed with roasted pistachios and sprinkled with the same powder and dunked in sugar syrup. The best!6) BELGIAN CHOCOLATE ICE CREAM AND BLUEBERRY CHEESECAKE ICE CREAMI personally loved the belgian one as it was very very smooth and chocolaty. The blueberry one was tangy and different than the regular sugary ones.Definitely worth experiencing this amazing place", "Superrrr, nice and wonderful"],
