    "reviews": ["It was a delight to be here.  The food was fabulous. Good portion size and very filling. The host helped us pick the dishes and it was a  perfect recommendation. Surely visiting again !", "The ambience is good, lively and soft music doesn't disturb and not very noisy. Cosy place, friendly and welcoming staff. Good service .A whole different authentic menu and lot of options for vegetarian preference.", " Bayroute serves Middle Eastern delicacies so it was something new for me.\n\nThe Ambiance was superb and lavishly done.\n\nWe had :-\nLOTUS BISCUIT- thick in texture. Amazing\n\nREYHAN- a dominant orange drink infused with soda.\n\nSALTED CARAMEL BAKLAVA- Milkshake filled with small pieces of nuts topped with baklava. It was best\n\nFood:-\nMOUTTABEL- made with smoked eggplant and curd topped with pomegranate served with bread. It was good.\n\nMUSHROOM KUBBAT- Hot mezze Stuffed Cutlets filled with mushrooms, processed cheese. This just cannot be missed.\n\nTURKISH GOZLEME- Flat bread Loaded with potato and cheese. Okayish.\n\nK&#039;NAFI JIBNEH- made from shredded wheat strand..topped with pistachios and saffron syrup loaded with mozzarella cheese. Superb!!\n\nZAFRANI MILK CAKE- Milk cake topped with cream cheese along with roasted pistachios.The sponge was soft.\n\nit&#039;s on expensive side but good food.  "],
