    "reviews": ["Toit, a Microbrewery located in Lower Parel in Mathuradas Mill Compound is the best place to hangout, when in town. The bar is spacious and has a great ambiance. They serve well-crafted beers namely \u2013 Belgian Witbier, Bevarian Hefeweizen, Blonde Ale, Indian Pale Ale, Irish Red Ale, Dry Stout. Average cost is Rs 1600\/- for two people with alcohol and Rs 250\/- for a pint of a beer. The bar offers plenty of options for finger food which are good in proportion. It has an amazing smoking hall which has a boat as a table right in the middle which gives a classic look to it. On weekdays, it\u2019s the best - go to place with family & friends for dinners and on weekends it gets converted into a happening nightclub. A must visit place to make your evenings wonderful.", "Awesome brewery  love the ambience & Food here", "Visited first time yesterday ... Loved the liveliness of the place ... Draught beer served perfectly with the ordered snacks ... Repeat value ... See you soon"],
