    "schedule_status": "Closed Opens at 12:00",
    "reviews": ["A very nice and vibrant interiors, with good lighting and soft music made my dinner very comfortable. We had:Appetisers:1. Khimchi Mushrooms- shewers of Mushrooms Marinated with Korean Chili Paste and Garlic.2. Feta Sambal Wontons- Broccoli Heart, Sambal Olek with Holy Basil Green Apple SauceMains:1. At Stir Fry- With baby pakchoy, chestnuts, squash, broccoli, silken tofu, lotus root and asparagus2. Flat Rice Hakka NoodlesDesserts:1. Mud Pie cakeDrinkers:1. Always virgin with Giner ale2. BreezerFood: 5\/5Ambiance:  5\/5Service:4\/5Cleanliness:5\/5", "Asian Town located at Kala Ghoda, Fort is a 10 minute drive from churchgate station. This gastrobar provides Fine Dining and Bar services. As soon as you enter the the vibe instantly teleports you to east Asia. The entrance and the interior decor is lavish and has multiple east Asian antiques and infrastructure. The place is huge with multiple soft sofas and chairs. The mood lightings and their curated music playlist accents the Asian drama in an absolutely classy manner. They have a TV projector setup so that you can enjoy your live match at live bar counter. Yes! They have a live bar counter which is elegantly displayed and surrounded by high chairs.The staff members are very courteous and their service is really spontaneous.They serve Asian, Chinese, Japanese, Thai, Malaysian and Korean cuisines. They provide a wide range fresh and delicious cocktails and mocktails. One can find a variety of sizzling appetizers, mains and deserts for both veg as well as non veg sections.What we ordered for lunch - AT Sichuan Balls -4.5-Super tempting fun balls filled with cottage cheese, chestnut and lotus root. They are flavoured in basil and chilli and tossed in hot sichuan pepper sauce. The flavour blends very well with the sauce.Cheddar Popiah Rolls-5- These are cheesy and crunchy spring rolls made with soft cheddar and scallion. These scrumptious rolls are served with tangy chilli sauce. They are presented in shot glasses. Highly recommended!!Sushi Rolls -5- They recommended avocado and cucumber sushi rolls. 4 sushi rolls served with wasabi are served on a flat plate. It surely exceeded our expectation. Devil's Love -5-This was cocktail with a vodka base and contained red grapes. It was served in coupe glass. The overall flavour bit sweet and sour with a mild alcoholic punch. This refreshing drink complements most appetizers. Fireball old-Fashioned -5-This was a whiskey based cocktail. It was served in a glass cage filled with cinnamon smoke. It can surprise you unprepared with its strong liquor taste. The chilled drink was served with a cherry and leaves a smoky trail with fruity flavours of orange and cherry. Highly recommended!! Thai curry -4.5-For mains we were suggested Thai curry and it certainly was a great dish. The hot aromatic green Thai curry was served with steaming hot jasmine rice. It consisted of galangal, asparagus broccoli and exotic condiments. The flavour was a mixed and mildly spicy one. We loved it. Sapporo Ramen -5- This is a big bowl of white miso ramen. It consisted of noodles and hot broth. The buttery broth was loaded with veggies like bok choy, zucchini and carrot. This was topped with saffron for flavour. The mix of veggies and condiments gives a spicy and flavourful taste. Chocolate Whiskey Pot -5-Chocolate Whiskey Pot is the perfect way to provide a happy ending to your meal. It is basically Dark Chocolate mousse with a little more consistency blended with whiskey. It is topped with a dollop of soft cream. The presentation with a chocolate wafer stick and chocolate drizzle is really an eye-catcher. The subtle flavour of whiskey compliments chocolate in a delectable manner.", "The perfect place for continental food. The service is quite good. Loved the ambience, crowd is decent, and lastly the food is amazing for people who love authentic chinese or japanese food."],
