    "reviews": ["Nice experience.. live music was the best part.. food was average", "We stumbled upon this place last evening as we wanted to relax and have something in a relaxing environment. 18th century was on my mind because of its pretty rooftop! This place is located in oshiwara , andheri west. Where  blanco used to be now it\u2019s 18th century. >Ambience - Beautifully done interiors with attractive light setup on a whole and slight touch of retro decor which overall comes up to be great one, they do have lounge arena  where you can relax in with some music. Rooftop section has bar which is great and they have live nights over here. >Food - The food served here is too good and the quality and quantity both are put up well. Loved everything what we had.>Hygiene- Premises indoor and outdoor of 18th century are kept hygienic and clean. >Value for money- The place always have some great deals or discounts for the patrons also the food is gastronomical hence it\u2019s definitely vfm. >Our order -R: denotes Recommendations.  \u2022DRINKS:1)Dragon ginger mojito(R)- Superb concoction of ginger and dragonfruit topped with soda and sprite having rum was fantastic.2) Rasberry and mint lemonade (R)- Traditional lemonade with a hint of rasberry and mint which resulted into a refreshing one and best to beat the heat. \u2022APPETIZERS:1) Prawns cocktail slider- 4 sliders having mayo , veggies and small prawns in it was served along crispy potato wedges. An amazing one! 2)Chicken skewers(R)- tender skewered chicken having richness in terms of texture and spice made to perfection and delicious one! \u2022MAIN COURSE:1)Murgh mussalam(R)- What a beautiful preparation ! Thick and scrumptious chicken gravy having rich texture and fine blend of spices presented well and tasted simply delicious was a great one over here. 2)Chicken schezwan fried rice- wok tossed fried rice having generous chicken and egg with spicy taste was a nice Asian main. \u2022DESSERTS:1)Motichoor pani puri with basundi shots(R)- A blissful end to your meal can be this one for sure. Lovely presentation with something unique thing to try on. Mootichur crumbles in a puri served with basundi shots. -\u2022- Overall experience was fantastic and we loved the place a lot! \u2022Food - 9\/10\u2022Ambience - 9\/10\u2022Staff- 8\/10\u2022Value for money - 7\/10\u2022HYGIENE- 10\/10*REVIEW IS BASED ON PERSONAL EXPERIENCE!", "An open rooftop ambience with gentle breeze, good food, and live music is a recipe for a perfect evening. More so if it is with your favourite person. We started with drinks: Raspberry mint lemonade and spiced passion(whiskey based). Perfect start for the day thanks to my barman Pankaj, who concocted a perfect drink for evening. For starters we had paneer chilli and seasoned skewered chicken(Definitely must try). For mains we ordered for the specialty by Chef Bisht- the Murg mussallam with garlic naan(must try). To cater to sweet tooth we had: Hunger strike and the awesome rose gulkand icecream. Thank you Bharat out manager for the day who ensured seamless gastronomic experience. Kudos to the 18th century rooftop management. All in all good value for time, money and energy. I definitely vouch for this place."],
