    "reviews": ["London taxi has recently open the outlet in Khar as well as they got a very good response in the lower Parel outlet.as London taxi is one of my favourite places to visit in lower Parel area hence I give a try to this place when it was opened in Khar...\nthe Ambience is just soothing and the place looks very nice the service of the place is also amazing the place is newly opened and they are open to suggestions... But according to me this place is just perfect...\nThe food they serve is really delicious and fit for a king.\nThe drinks they provide is just amazing is refreshing and will surely re-energize you.\nThis was my first visit to the Khar outlet but I am sure there are many more visits coming up soon.\nI thank the team of London taxi Khar for making my experience so amazing.", " LONDON TAXI ???? is the most happening restaurant in Khar \nAfter the success of the outlet in Lower Parel they opened up here in Khar \nLONDON TAXI ????  is quite lit up with catchy lights ????,colourful walls ,photo frames ???? & comfortable seatings\nLONDON TAXI ???? isa great place to hang out with family & friends ???? ???? ???? \nThe samosa chaat Tostada excellent & a must try \nSpinach cannelloni mind blowing & cheesy ???? \nMocktails were mind refreshing \nAll the dishes that we tried were great in taste & appealing presentation \nChocolate hazelnut & banana parfait was outstanding & highly recommended \nOverall we had a great ???? time along with brilliant service \nLONDON TAXI ???? KEEP THE GOOD WORK GOING & WAITING FOR MORE OUTLETS TO OPEN UP ???????? ", "Khar just got more happening place coz of LONDON TAXI. We were overwhelmed by this mind-blowing place.\n\nLONDON TAXI has a new modern indian cuisine which is fabulous, the presentation of food & drinks also fantastic.\n\nLONDON TAXI has a huge bar n great light settings. The seating is very comfortable, high chairs & low rise chairs and sofa seatings too.\n\nCocktails:\nSMOKEY WHISKY OLD FASHIONED: cheers.\nSAZERAC: ????????\n\nMocktails:\nSOBER SHERLOCK: fabulous presentation.\nCRANBERRY TWISTER: decent.\n\nAppetizers:\nSAMOSA CHAT TOSTADA: loved it.\nPANNER TIKKA SANDWICH: nice n soft.\nCORN AND CHEESE EMPANADAS: ????????????\n\nMain course:\nSPINACH CANNELLONI: definitely worth.\nEARL GREY SMOKED DAL MAKHANI: great taste.\n\nDessert:\nCHOCOLATE HAZELNUT N BANANA: ????????\nBELGIUM DARK CHOCOLATE N WHISKY MOUSSE: delicious all the way.\n\nMust say, LONDON TAXI second outlet is beyond n more. ????????????????????????"],
