    "price_score": 2,
    "cuisines": "Japanese",
    "schedule_status": "Closed Opens at 12:00",
    "reviews": ["I've tried so many Asian places but Yazu it's just different. Every Asian place has that Indian touch to it , but none of them has that authencity. When I went to Yazu I tasted the Authentic Asian food.CocktailsWhen it comes to cocktails they have some really amazing in-house drinks. More like a Asian blend. We tried \"Upside down Old fashioned\" and \"Wasabi Martini\" The creativity in both the drinks is weirdly amazing!StartersThis places has some amazing Sushi , small bites , dumplings and so much more! They literally had Chinese , Japanese , Thai every Asain cuisine on their Menu! We tried \"Classic California Sushi\" and \"Signature Turnip Cake\" which is a must try! There's is legit nothing like it!Main courseFor main course we decided to order \"Veg Yazu Signature Spicy \"Ramen\" Noodles\" and these are like the best noodles you will ever eat. The taste is so balanced the Ramen makes it taste so much better! Along with the Noodles we ordered \"Preserved Cottage Cheese\" which has a black bean gravy and the cottage cheese is just so soft with that finger licking gravy makes up for a perfect combination for the Main Course.DessertsYazu has this really artistic dessert called \"Hot Chocolate Souffl\u00e9\" , it's crispy on the outside and fluffy on the inside. And it served with Vanilla ice cream. The best part about this dish isn't the luscious taste that you're gonna fall in love with but the presentation of this dish which make you speechless. If you're missing out on some good Asain food , then \"Yazu\" is a must go. Because you just can't find better Asain food than this. Moreover the ambience and the staff makes your experience even better!", "Pathetic foods", "Nice place to visit for Japanese food"],
