    "reviews": ["Truly exploring the diverse flavours of India! Its heartening to experience the experimentation  new age chefs are doing with Indian cuisine and celebrating the diversity of spices and mixing it up.  Simply loved it!", "Good location and ambience, fantastic food and service. All dishes are tasty and unique.", "TRESIND - FOOD REVIEW ONLINE (FRO)\n\n.\nLOCATION: BKC, Mumbai\nCUISINE: Modern Indian\nAVERAGE COST: 1500 for couple (approx.)\nWORKING HOURS: 12noon \u2013 3:30pm, 7pm \u2013 12midnight\nWHEEL CHAIR FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO.\n.\nWhat we love here: Khichdi of India, Kebabs, Vegan Carpaccio, Palang Tod, Kaju Katli. .\nWhy Visit: Located in BKC, @tresindmum expect a larger-than-life dining experience at this restaurant.\n.\nLocation: 5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbience: 5\nHygiene: 5\nService: 5\nCost: 5\n.\nOur Review: 5 \/ 5\nAromatic airs and an amuse bouche, along with deconstructed fare takes you on a culinary journey. And the chic, futuristic interiors perfectly compliment the energy of the space! Corporate Chef Himanshu Saini has skilfully crafted a culinary experience that engages all the senses. The menu showcases traditional dishes from the sub-continent, encompassing the various regional culinary influences. The concept of gu\u00e9ridon service, along with clever plating and global cooking techniques, takes the dining experience to the next level. The handcrafted beverage repertoire here complements the food. The 'Vegan Carpaccio', aesthetically presented, gets you off to a good start. The 'Mutton Khari', with robust, but refined flavours, will wow the palate of any carnivore. The aplomb with which the simple 'Khichdi', representing several States in India, is served on the table, coupled with the honest flavours, makes it one of the highlights here. For dessert, the inventive 'Kaju Katli' and 'Palang Tod', is a treat. Although the food is served with a dramatic flair, it is replete with bold flavours, which pack a punch. The service is exemplary and the staff, articulate. .\n. Follow @foodreviewonline or www.foodreviewonline.com\n.\n.\n.\n#foodreviewonline #kailashshahaniofficial #indianfood #foodie #food #foodporn #foodphotography #instafood #foodblogger #foodgasm #foodlover #india #foodstagram #yummy #indianfoodbloggers #tasty #foodtalkindia #delicious #indian #foodies #indiancuisine # #finedining #indianfoodblog #desifood #vegetarian #eatclean #mumbai #love #mumbaifood #tresindmumbai"],
