    "reviews": ["It is located in vile parle next to domestic airport.its on the top floor so we can see the domestic airport cleary.The ambaince is awesome .The decor is nice", "The Ambience is awesome, food, service is also excellent i loved the place superb", "MOSTLY GRILLS - THE ORCHID - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: VILE PARLE, MUMBAI\nCUISINE: CONTINENTAL, AMERICAN, NORTH INDIAN\nAVERAGE COST: 2000 for a couple\nWORKING HOURS: 4 PM \u2013 12 AM\nWHEELCHAIR FRIENDLY: YES\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO.\n.\nWhat we love here: Chilled Nutty Mascarpone, Char-Grill Balsmic Garlic Prawns, Bharwan Khumb, Murgi Malam Kebab, Pahadi Saag, Khush Parda Murgi.\n.\nWhy Visit: Experience an exquisite rooftop view at a fine-dine serving a large variety of delicious food\n.\nLocation: 4.5\nTaste: 5\nQuantity: 5\nPresentation: 5\nAmbience: 5\nHygiene: 5\nService: 5\nCost: 4\n.\nOur Review: 4.5 \/ 5\nAs the aroma of the grilled food cuts into the air, you, in the meantime get to enjoy the sights around you @mostlygrills_orchid, there is a shimmering pool on one side and an airport runway on the other while the stars shine overhead. The 'Taverna' bar provides the cocktails and spirits you want to wash the food down. Staff is top notch in hospitality. We began our evening with Chilled Nutty Mascarpone, Poached Pear Smac and Char Grill Balsmic Garlic Prawns which was a perfect start to our mind blowing evening. Later we moved to their very delicious Kebabs called Bharwan Khumb (veg) Murgi Malam Kebab (Non-Veg). We tasted their Pahadi Saag (truly recommended) and Khush Parda Murgi for mains and it was scrumptious. The best dish from the menu was the Cannaidian Sizzling Steak which was lip-smacking also vegetarian. For Non-Vegetarians River Sole Navido and New Zealand Lamb Chops are up to the mark. Finally, for Dessert we tried and loved their Chocolate Jar Cake, it is the perfect end to your meal. Lovely place to visit for an amazing view and scrumptious food.\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #food #foods #foodie #instafood #foodphotography #yummy #delicious #love #instagood #foodstagram #foodblogger #foodlover #foodgasm #follow #dinner #lunch #tasty #restaurant #finedining #foodies #mumbaifood #mumbai #mumbaikar #mumbaifoodie #restaurant #rooftops #mumbaifoodlovers #mostlygrills_orchid"],
