    "reviews": ["It s great Tatse.u have to visit any FullFills Cafe India", " European styled Decor.\n\nIt&#039;s a very small joint. They have some outdoor seating area too But cool place to hang out with your friends and Family.\n\nWell I tried Bella Donna Pizza Thin crust pizza with amount of Mozzarella cheese and with generous toppings on it (capsicum, onions, olive, jalape\u00f1os, sun dried tomatoes ) freshly made pizza. It was baked to perfection.\nThe taste was up to the mark.\n\nI recommend everyone to try this pizza here and its worth the money.\n\nFriendly staff.\n\nTheir efforts of serving something different absolutely deserves a visit.\n\n ", "Location: Shop 1, Neptune Avens, Vallabh Baug Lane, Khau Galli, Ghatkopar East, Mumbai\nCuisine: fast food, desserts, beverages\nAverage cost: 300 for two people (approx.)\nWorking hours: 2 pm \u2013 12 pm midnight\nDisabled friendly: no\nOutdoor seating: yes\nValet parking: no\nCredit card payment: yes\nTakeaway: yes\nFree wifi: no\nKids friendly: yes\nVegetarian only: yes\n.\nWhat we love here: pasta, pizza, sandwich, mexican fusion, paneer makhani, chocolate icecreams, paneer chatpata.\n.\nWhy visit: known for serving chimney cone fills and other european delicacies like pasta, pizzas, desserts, and beverages.\n.\nLocation: 4\nTaste: 4.5\nQuantity: 4\nPresentation: 4\nAmbience: 4\nHygiene: 4.5 \nService: 4.5\nCost: 4\n.\nOur review: 4.5 \/ 5\nFulfills is located at Ghatkopar. It comes with a pretty decent ambiance which gives you a calm and relaxing feeling as you enter. The seatings on the inside are wooden table attached to the walls and with high rise stools to sit on and a lavish sofa set. Be it a quick snack or a dessert option, they have it all. They have a wide variety of cones to choose from; sweet and savory. Take your pick from Hummus Peri Peri with falafel to Paneer Makhani cone and Pure White chocolate cone to Hazel cones to devour off the menu. Do even try their sandwich menu, Kheema Kasturi Sandwich is highly recommended. They also have Cheese Lasagna for Lasagna lovers. The service is quick and the staff is also very friendly. Overall a most recommended place if you are in a group with different choices like one prefers a burger, others prefer pizza, and sandwiches, etc. they have got it all.\n.\n#foodreviewonline #staunchtravelerofficial #foodie #foodlover #foodaddict #foodblogger #food #foods #snacks #foody #foodgram #foodislife #foodlovers #foodielife #foodpic #yum #tasty #foodblog #foodshare #foodaholic #foodspotting #goodfood #healthyfood #instafood #foodcoma #foodofmumbai #mumbai #instagood #goodvibes"],
