    "schedule_status": "Closed Opens at 11:00",
    "reviews": ["So yesterday we visited New York Burrito Company , it has many outlets in Mumbai, we went in ghatkoper's outlet. Itsa small outlet with decent Ambience. It has amazing wallarts of Mexican food and related stuffs. The staff present there are really helpful and friendly. Their service is really nice . So its a mexican cuisine outlet. What we had-Tacos - it was crispy and filled with veggies and cheese . The sauxw in it was giving  really a nice flavour and overall we liked itMexican Bowl - they have variety of options you can customise it according to your choice. We had white rice, Paneer, lettuce and various sauces and tomato salsa. Then topped it with cheese.It was healthy, veggies were fresh  Hibiscus Mint Lemonade - it was sweet, sour , tangy and had a refreshing flavour. it was an healthy drink We would say. Nuttela Cheese Quadilaas - It was simple dish but we loved it . Perfect mixture of nuttela and cheese .Tres Leeche Cake - This was the best part. we really liked it a lot. It was so soft and perfect in taste. You should definitely try this. It was not too sweet, but amazingin taste. Highly recommened!!Taste Service Ambience Value for Money If you love Mexican food or if you want to try it , this  should be your destination place!!", "I visited around 9pm. Most of the ingredients were over and hence the staff was adding small quantities and offering other ones. You have to be vigilant and tell them to customize them appropriately. While they try to be like  New YOrk burrito company, like Chipotle and all, the overall taste was strictly okay. The main options were interesting - we selected peri-peri potatoes: they were not very good and seemed half rotten or on the verge of being spoilt. Overall, I feel there's potential - but there is scope for improving.", "NEWYORK BURRITOBeen Here Yesterday they are having various outlets across all mumbai.We Visited At Ghatkopar branch.The Tasty Food Served Here is Served Very Quickly.We Tried Here a Wide range of dishes like..1:Medium Paneer Burrito Wrap2:Potato Mexican Bowl3:Mexican Pizza4:Tacos Loaded with veggies5: Super Nachos Loaded With Beans N Veggies6:Dragon Fruit Lemonade7:Hibiscus Mint Lemonade8:Tres Leche Cake9:Choclate Walnut Brownie.All The Items we Tried Were very Healthy n Nutricious.All The Veggies N toppings Added Were fresh and of good Quality too.Must Visit For gym Freakers n people who are very Health consious.The Desserts Served Were Aslo Tasty.The Drinks were aslo good was giving refreshing feel.Overall Had A Good Experience in Reveiwing this Outlet.Thank You"],
