    "schedule_status": "Closed Opens at 14:00",
    "reviews": ["Delicious waffles and excellent service with cozy ambience. Perfect place to hangout with friends.", "Hello! World of Waffle is the perfect dessert stop for chocolate famished people.We ordered Waffle Sundae : Ferrero Rocher Ice-cream sandwich : Choco Coffee.\u2022Servings and Price:I felt the price was a bit too high considering the size of the servings but with Zomato gold offers, the food was quite pocket friendly.Approx \u20b9400 for 2 people.Approx \u20b9200 for Zomato gold users. (1+1 food)\u2022Service:Quite a friendly staff who manoeuvered me through the menu. But the service was a bit slow as our order took almost 15 - 20 mins despite the slow crowd.\u2022Taste:The presentation of the waffle was a delight for the eyes. Quite pleasing and stomach growling with chocolate oozing on the plate. The Waffle Sundae had the perfect Savory and sweet taste. I loved it! A must try!Choco coffee, the ice-cream sandwich had a overwhelming taste of coffee which dominated the plate. It was a bit too strong for me. I would recommend this plate to caffeine lovers!\u2022Ambience Quite up-beat and pleasing ambience. It had the perfect balance of those retro wallpapers and fairy lights. They had small Tic-tac-toe and ludo games offered on every table for pass time. I wish there were more boardgames for entertainment :)Overall I would love to visit this place again and try other flavours on the menu4\/5 stars.", "Awesome place good taste"],
