    "reviews": ["Ambience in gathering ground is awesome. They have exciting platter options from chinese to mexican. Rates are not to high. Basically the name says if you want to have a get togehter this place is great to have in your list.", "Grab and go kind of place ... Not a sit down family meal kind of place .. good for younger crowd looking to spend time .. food was good", " Visited this cute cafe kind of place for a brunch. The seating of this place is very comfortable. They have various board games. They also have fooseball table which is amazing. The staff is courteous. The place is easy to locate as it is situated in runwal greens.\nComing towards food, we ordered\n\n1. GG star pizza which looked so unique and tempting at the same time. It was nearly star shaped so the name is star pizza. It had topping (filling) of paneer which tasted like paneer chilly sabzi. They also provide soya stuffing. Taste wise it was good.\n\n2. Spicy fries which were normal fries tossed with some red chili powder. It was basic nothing exceptional. The price seemed more to me.\n\n3. Chocolate melanche which was a heavy dessert. It had lots of things. Basically brownie topped with ice cream and different types of chocolate decorations. Looked beautiful.\n\nOverall it&#039;s a nice place to spend quality time with your loved ones.\n\nAmbiance: 4.5\/5\nFood: 4\/5\nPrice: 3.5\/5\n\nPlease follow us on Instagram and Zomato ???? "],
