    "reviews": [" I was in office I ordered from Box8 is very good deliver outlet specialty is desi food and its yumm I hav tried dal makhani and very very tasty I will order soon.... ", " Box 8 \n \nBox 8 is the best Food delivery outlet. I enjoyed each and every food ordered from  Box 8.\n \nStarters : \n1. Teekha - Meetha Chicken wings\n2. Grilled Murgh Seekh Kebab\n3. Chicken Tikka chur - chur\n\nWraps : \n1. Chicken XXL Wrap - Whole wheat\n2. Seekh kebab wrap - Whole wheat \n\nMain course : \n Chicken Tikka Biryani\n\nBeverage : \n Coke - Cola\n\nDessert : \nChoco Lava cake. \n\n\n\nStarting with the startes, they were really great. Mouth watering and tempting to your eyes. The kebabs were tenderly soft, nicely cooked, and served.  Also the chicken was something different to taste. I liked the flavours mixed with it. The sweet n spicy taste made it taste fabulous. The chicken tikka is just the same as other restaurants\/delivery outlets.\n\nThe main course. Chicken Tikka Biryani was stomach filling. The rice was cooked and it was fresh. The chicken pieces were soft and flavoured very well. Coming to the wraps. According to me, the wraps were average. I didn\u2019t like the taste. I feel the wheat dough was not good. It was really hard to chew. But still they have done good in making it. I appreciate it. \n\nDesserts are always the best part of any meal. The choco lava cake is so tempting to anyone\u2019s eyes. There is no need to compliment any desserts as they are always the best part of any meal. \n\nI am glad to and obliged to write this review. Hope it helps. ", "This review is from few of us who have ordered from Box8..this is is very tasty and delicious..they have chicken salad also which is very healthy and I loved it .."],
