    "reviews": ["Service was poor, food above average, only party people can enjoy", "Nice place to hang out. Service is very slow", "Location: Unit 1, A- Wing, Kailash Business Park, Parkside, Vikhroli, Mumbai\nCuisine: north indian, continental, asian, italian, malaysian, pizza\nAverage cost: 1500 for two people (approx.)\nWorking hours: 12 noon \u2013 1:30 am\nDisabled friendly: yes\nOutdoor seating: yes\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes\nVegetarian only: no\n.\nWhat we love here: neer dosa, salad, cocktails, mocktails, pizza, pav bhaji, coffee. .\nWhy visit: a hidden gem in vikhroli and perhaps the only one nightlife place in vikhroli.\n\nLocation: 4.5\nTaste: 4.5\nQuantity: 4.5\nPresentation: 4.5\nAmbiance: 5\nHygiene: 5\nService: 5\nCost: 4.5\n.\nOur review: 4.5 \/ 5\n.\nGlobal Quarters is located at Vikhroli. Global quarters is the newest addition to the eateries in the Vikhroli-power section of the city. The place has a grand decor and has comfortable seating on the 1st floor of the section. One thing to note about this place is that every day they have something special like for Monday and Tuesday they have factory hours, Wednesday is the Bollywood night, Thursday they have unplugged night, Friday they have club night, etc. Weekend attracts a good crowd with the in house DJ being playing throughout the evening. The place serves different types of cuisines including the modern Indian preparation of food. The place also serves in-house brewed beers alongside some interesting mocktail concoctions. However, the amount of sweetness to the mocktails is restricted to natural flavors of fructose. For the people who are looking for food do try their Neer Dosa. Neer dosa with Gassi chicken is a highly recommended combination here. The service is amazing and the staffs here are friendly. This place is highly recommended for people to go in larger groups in order to get the fullest enjoyment. Overall for the people who are in central line looking for nightlife with good music must visit here.\n.\n.\n#foodreviewonline #staunchtravelerofficial #bar #dj #drinks #cocktails #music #party #bartender #food #drink #beer #club #cocktail #instagood #pub #restaurant #nightlife #mixology #dance #wine #friends #lounge #instafood #yum"],
