    "reviews": ["It's a unique experience", "The staff suggested some really good food. Liked the whole vibe. In all a great experience.", "The Indian restaurant makes a mark with its food and by employing speech and hearing-impaired waiters.\nDiners are given a crash course in sign language before they place orders with the speech and hearing-impaired staff at Mirchi and Mime. Far from being a hassle, its a pleasure as the idea is to support people with disabilities. Its also quite simple once you get the hang of it. The menu lists a medley of items from around the country. The food is well-prepared and they have a few items for the adventurous such as guinea fowl, which is rarely found in restaurants. The place is cozy and welcoming with grey couches and warm lighting.\nWhy VISIT \nMirchi and Mime is a socially responsible yet sustainable restaurant chain in Mumbai\u2019s Powai area that employs people with disability as servers, supervisors, and chefs \u2014 in effect, making use of their special abilities.\n\nRECOMMENDATIONS\nVegetarian: \nAssorted Tawa Platter \u25cf Morel Biryani \u25cf Nilgiri Makhana Curry\nNon-Vegetarian: \nChicken Yellow Mirch Tikka \u25cf Raw Mango Prawn Curry \u25cf Duck Seekh\nDesserts: \nNutella And Toffee Tart Fine\n\nLocation: 5 \/ 5 @ Gem of Powai and I should say Pride of Mumbai. \nTaste:  5\/5 @ The taste was simply mesmerizing and perfect for Indian Palate. \nQuantity: 5 \/5 @ Perfect quantity for 2 people.  \nPresentation: 5\/5 @ Awesome presentation and effort was quite evident  \nAmbience: 5 \/5 @ Great feel and the entire ambience makes you and your food feel special.\nHygiene: 5 \/5 @ Open Kitchen concept and meticulously clean.\nService:  5\/5 @ Great service and of course our host Nihar ensured that we were taken care of right till we checked out. \nCost: 4\/5 @ This has the scope of change as I feel the experience should not be limited to luxury fine dining and someone with lesser ability to afford should not be left out.   \n\nOverall : 5\/5 \u2013 DEFINITE VISIT !!"],
