    "reviews": ["Food is surprisingly good & Staff is also very helpfull & pleasent..But the Upstairs is not a good place for photography.Lights are bit dim & placed from where we shall not b able to get good pics other than that...its a very good restaurant", "Good food, Mixed cusine and options for everyone", "Location: Shop no 2, 3, 4, Marathon Max, Mulund (W, Salpa Devi Pada, Mulund West, Mumbai. \nCuisine: north indian, italian, chinese, mexican, lebanese\nAverage cost: 800 for two people (approx.)\nWorking hours: 11:30 am - 3:30 pm, 7 pm \u2013 11:30 pm\nDisabled friendly: no\nOutdoor seating: yes\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes\nVegetarian only: yes\n.\nWhat we love here: veg manchurian, burritos, peach mocktail.\n.\nWhy visit: a place whose interesting ambiance clearly reflects the traveling hobby of the owner.\n.\nLocation: 4.5\nTaste: 4.5\nQuantity: 4.5\nPresentation: 4.5\nAmbience: 4\nHygiene: 4.5\nService: 4.5\nCost: 4.5\n.\nOur review: 4.5 \/ 5\nTick - eat located in mulund. It is a restaurant with comfortable seating and wanderlust theme. The ambiance of the restaurant is something you might have never seen before with the wall and the roof all designed like a globe and good decor. Mr Dhaval the owner of Tick \u2013 eat has a personal connection with the ambiance of the place. He has the ambition of traveling the world and says all of us have a bucket list. Hence the map designed ambiance and the name tick-eat like in the tick we do in our bucket list. Creative drawings on the wall, hanging toy planes add more glitter to the already lavish place. There is also a small seating arrangement on the upper deck of the restaurant which is a banquet hall and generally reserved for weekends. It is also a place where one would want to visit with family because of the fancy yet decent ambiance. The staff makes sure that the waiting time is less. We tried here Veg Manchurian, Burritos and Peach Mocktail. Overall if you are a vegetarian and in search of a place with interesting ambiance and food then this is where your search ends.\n.\n.\n#foodreviewonline #kailashshahaniofficial #desserts #food #dessert #yummy #chocolate #foodporn #instafood #delicious #cake #foodie #instagood #foodphotography #icecream #tasty #yum #dessertporn #sweets #love #cakes #eat #sweettooth #coffee #foodgasm #baking #foodpics #pastry #cupcakes #patisserie"],
