    "reviews": ["This place had a major laid back experience. They aren't cared about the guests or the services.", "Lit placeMust visit place I would.Decent ambience, great music, happening crowd, family friendly, andd what else you want.They have great collection of indian and Western pop music.And the actually live DJ begins after 10pm which will force you to leave your table and dance....", "MANSION BAR AND LOUNGE - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Mulund West, Mumbai\nCUISINE: North Indian, Italian, Mexican, Chinese\nAVERAGE COST: 1700 for two people (approx.)\nWORKING HOURS: 12 PM to 1 AM\nWHEELCHAIR FRIENDLY: NO\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: NO\nKIDS FRIENDLY: NO\nVEGETARIAN ONLY: NO.\n.\nWhat we love here: Paneer Burji Nachos, Mansion Caesar Salad, Techa Fondue, Mansion Golden Chocolate Ball.\n.\n.\nWhy Visit: Much needed atmosphere after a long hectic day of work. .\nLocation: 4\nTaste: 4\nQuantity: 4\nPresentation: 4\nAmbience: 4.5\nHygiene: 4\nService: 4.5\nCost: 4\n.\n.\nOur Review: 4 \/ 5\n@mansionbarnlounge is a great place located at Mulund West, it is slightly hard to find considering it is on the 5th floor of a very silent and peaceful building. They have a beautiful rooftop seating area where you can find a fountain surrounded by Greek Pillars. However, this section is closed when it rains so pick your time of visit after checking the weather reports. They also have indoor seating where you can find comfortable velvet couches and high seats. Apart from that they also have a DJ with great taste in music. Coming to the food they provide a variety of good food. For chakna they have really good Paneer Burji Nachos and Butter Garlic Rawas. Their Mansion Caesar Salad is top-notch. We tried their starters Stuffed Bhavnagri Chilli, Pepper & Black Olive Cigar, Kali Mirch Malai Broccoli, Techa fondue which forms a part of their recommended menu and these dishes are truly worth being a part of that list. For Dessert, we tried their special Mansion Golden Chocolate Ball which is very delightful in taste. Overall I can say this is an ideal place to relax to make the best of your weekend. .\n.\nFollow @foodreviewonline or visit us on www.foodreviewonline.com.\n#foodreviewonline #kailashshahaniofficial #foodie #food #foodporn #foodphotography #instafood #foodblogger #foodgasm #foodlover #foodstagram #yummy #tasty #continental #delicious #indian #foodies #indiancuisine #mumbai #love #mumbaifood #indianfoodblog #mumbaigram #bar #foodstagram #food #beer #lounge #pizza #nightlife"],
