    "reviews": ["Place for family eves", "Great vegetarians food.. awesome place. A bit costly though.", "Family Tree\n\nLocation: Shop 4, Ravi Industries, Panch Pakhadi, Thane West. \nCuisine: international, regional specialities, salads.\nAverage cost: 800 for two people (approx.) working hours: 11:30am \u2013 3:30pm, 6:30pm \u2013 11:30pm\n.\n\nDisabled friendly: yes\nOutdoor seating: yes\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes\nVegetarian only: yes\nVegan-friendly: no\nJain friendly: yes\n.\nWhat we love here: Caesar Salad, Mocktails, Mint Mojito, Oreo Waffle, Pasta, Stuffed Mushroom.\n.\nWhy visit :\nTaking the concept of family dining to a new level, Family Tree believes that a family that eats together stays together. .\nOur Scores\nLocation: 4.5\nTaste: 4.5\nQuantity: 4\nPresentation: 4.5\nAmbience: 5\nHygiene: 4.5\nService: 4.5\nCost: 4\n.\nOverall : 4.5 \/ 5\n.\nFamily Tree is loacted at Panch Pakhdi admist a variety of other option stands out and marks its presence with a warm and cozy ambience. They serve a variety of vegetarian Continental dishes to choose from. Family Tree is designed to celebrate the best of family traditions! To begin with, chairs around the tables have a caricature of a family member drawn on it. A chair for dad with a very fatherly figure drawn at the back of it, a grandfather\u2019s chair with a drawing of a cute old man, a grandmother\u2019s chair that almost replicates all cute looking grannies, and obviously a seat for the mother of the house. Kids get to pick theirs too! The menu also comes in the form of an old photo album. We tried their Mexican platter which serves Cheese Spinach roll, Mexican Shaslik paneer, Cheese Paneer Cigar, Jalepeno poppers and California baked potatoes. We also tried their 3G mocktail which is great and can be sipped in between the meal to clean your palette. The staff is amiable and the ambience makes you feel at home. This is a perfect place if you are looking to have a harmonious family time and good meal.\n.\n#foodreviewonline #thane #thanefoodie #mumbai #vegetarian #vegan #jain #vegetarianfood #vegetariano #goodfood #goodvibes #mumbaifood #instafood #foodie #foodlover #blogger #mumbaifood #mumbailife #mumbaifoodie #food #foodlover #instamumbai #vegetarianisim #healthyfood #salads #mocktails"],
