    "reviews": ["Nice food. I am a vegetarian and I enjoyed the starters which they had served. Starters were palak papadi chat, paneer Tikka, corn cheese balls and potato chat. Chuski (ice gola) were served in cute small cookers.", "Great place, awesome ambience. You can come along with your close ones or your family as per what you need in terms of ahem food or drinks.", "India Bistro is a fine dining gastronomical experience.They serve modern Indian cuisine.India Bistro is a family dining restaurant and is currently hosting Biryani Festival.We visited this place last night. We tried,Pani PuriFirangi chicken marinated in peri peri spice.Muradabadi Biryani - A bit spicy to my taste but delicious to taste.Drinks we tried their refreshing MocktailsMango Basil Melody & Mandarin Basil Caprioska.Dessert we had a kesar phirni, which has a lovely presentation.Second Visit.We recently visited again at Indian Bistro to try their buffet.The buffet was fairly priced in the range of 700-800.They offer a welcome drink, chaas, 1 soup, 4 varieties of starters, 3 varieties of mains for both veg and non veg and 3 varieties of desserts.They had a vegetable biryani instead of rice.Soup and Starters are served on the table.The food tastes really well, good quality, buffet is worth the price.Thanks to Asst Manager Mr. Naresh.He ensured service from the staff was at its best.Had a great time. Shall soon visit again."],
