    "reviews": ["The Dansing Bottle \u2665\ufe0f\n\nA nice place in the Hiranandani Meadows area which is away from the city. I recently visited with my friends for a casual dinner. They have a nice rustic ambience and a live DJ plays music at nights.\n\nWe had a nice Dinner and we really enjoyed the Music. It was a nice experience for a change and would love to visit again with my friends.", "We there&#039;s for my friend bday party, it was paisa vasul\nDance floor was amazed with live dj.\nIf you want to try new in drinks must choice is\n1. Jim Beam bourbon\nYou never forget taste of jim beam for sure\nFor starters we ordered shredded chicken and pizza\nI loved the taste for chicken which is overloaded with white sous.\nAs drinks priced are on MRP after including blah blah tax price get double.", "Good experience, I really love this place and the serving staff is very polite.."],
