    "reviews": ["Good place to eat but little expensive", "Should try Egg Benedict", "EVERYDAY ANDAY - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Naupada, Thane West \nCUISINE: HEALTHY FOOD, CONTINENTAL, CAFE,\nAVERAGE COST: 500 for two (approx.)\nWORKING HOURS: 7 AM \u2013 11 PM \nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: NO\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: NO\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO.\n.\nWhat we love here: Farmers Omelette, Eggs Benedict, Egg Tart, Pancake, Baked Scrambled Eggs, Egg Biryani and Vitamin Milkshake\n.\nWhy Visit: Come and explore some eggcellent recipes from the eggsperts! .\nLocation: 4\nTaste: 4.5\nQuantity: 5\nPresentation: 4.5\nAmbience: 4.5\nHygiene: 5\nService: 5\nCost: 5\n.\nOur Review: 4.5 \/ 5\nEveryday Anday founded by Ms. Rashmi Joshi with an aim of introducing all day breakfast place which serves a fusion of Continental and Indian dishes. Later it became an all-day egg restaurant for all the eggitarians out there. The ambiance of this place is very spacious and hygienic with hanging light bulb, and egg artwork on the wall as a part of their d\u00e9cor which will give you a clear eggplace vibe also the interiors are colored with yellow and white color. Their seatings are also very comfortable. With over 50 varieties of egg preparations, you\u2019ll enjoy devouring your age-old beloved protein-source in ways that you may have never tried before. Coming to their most recommended food, you can go for egg biryani, egg benedict, grilled chicken omlette, etc. All the food you get looks very hygienic than the usual places where you get egg dishes. The service is good and the staffs are good in giving recommendation. Overall this place is heaven for egg lovers or can be a place for someone who wants to experiment with eggs. .\n\nFollow @foodreviewonline or visit us on www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #mumbaifoodie #mumbaifoodiee #mumbaifoodguide #mumbaifoodhhoggers #mumbaifoodfinder #mumbaifoodplaces #mumbaifoodilicious #mumbaifoodlove #mumbaifoodtrail #mumbaifoodlovers #mumbaifoodicious #mumbaifoodjunkie #mumbaifoodcrush #mumbaifooddiaries #thane #thanefoodie #thanefoodies #mumbai #food #yum #mumbaifoodblogger #foodporn #egg #biryani #scrambledegg #foodie #omelette #pancake"],
