    "reviews": ["Check on zomato.", " So the other day I was roaming with my college friends and we ended up in Viviana mall. So we thought we should go to hitchki as we all know how famous it is.\nEven from outside it was looking good.\nIn starters we ordered\nMy name is chicken, chilli chicken which is basically a spicy chilli chicken and was good in taste then we had Anna it&#039;s hot, this too is a chicken starter.\nThen in mains we had chicken tikka Biryani. Their biryani quantity is so good that we couldn&#039;t finish it and it was spicy too.\nSo we ordered some drinks to balance our taste buds so we had He-Man and snow white.\nIn dessert we had chocolate Lava kulfi. This is basically a chocolate Lava cake which is served with malai kulfi . I absolutely enjoyed this combo. ", " Went to hitchki in evening for a light snack but ended up having heavy dinner. I absolutely loved their cusine.\nFirstly in starters we had -Spring roll :-It was cripy served with chinese sauce .Stuffing was pretty good.Taste wise 4.5\/5\n-Mini me-Mini kulchas served with cheese and mint chutney.The stuffing and cheese were less ,taste was pretty good.Taste wise 4\/5\n\nWe enjoyed this starters with their amazing drinks like Sweety tweety and Dil maange more. Sweety tweety is one of the most amazing drinks I had till date.\n\nThen for mains we had\nPaneer ale lababdar-The gravy was spicy and tasty but the paneer was too hard and was difficult to get into pieces.It was served with butter parathas.Taste wise 4.5\/5\nAfter having so much for desserts we ordered baratiyo ka swagat, which was pretty awesome.\nLastly the most important thing for which hitchki is really famous, that is it&#039;s ambiance. They have really cool ambiance "],
