    "reviews": ["A rich experience of Kolhapur Cuisine. Spicy but terrific menu. We three friends enjoyed Chicken Thali. I will come with my Family.", "Good service. Best food. Plz visit once for spcly kolhapuri spicy dishes.", "MH 09 Shetkari - Thane\n.\nLocation: 5, Jeevan Vikas Society, Near Parsik Janta Bank, Luiswadi, Panch Pakhadi, Thane West, Thane.\nCuisine: maharashtrian\nAverage cost: 500 for two people (approx.)\nWorking hours: 12:30 pm \u2013 3 pm, 7 pm \u2013 10 pm\nOutdoor seating: no \nCredit card payment: yes\nTakeaway: yes\n.\nWhat we love here: Pandhra Rassa, Mutton Thali, Mutton Masala, Egg Curry, Kolhapuri Chicken Thali, Chicken Fry, Veg Thali.\n.\nWhy visit: Craving for some home cooked style Kolhapuri food? This is a place you must stop by for an indulging experience.\n. \nOur Scores \nLocation: 5\nTaste: 5\nQuantity: 4\nPresentation: 4\nAmbience: 4\nHygiene: 4.5\nService: 5\nCost: 4\n.\nOur review: 4.5 \/ 5\nMH 09 is an extension of the Shetkari well known in Kolhapur for servicing authentic Kolhapuri cuisine for about 20 years. This is a small place with humble ambience. They can accommodate around 16 people at a time, so you might have to wait during peak lunch & dinner hours. There are chairs kept outside for you to wait and you\u2019re served with \u2018Kokam sarbat\u2019 as welcome drink this is a sweet gesture when you\u2019re a visiting on a hot summer day. There is a common notion that Kolhapuri cuisine is very spicy, but let us tell you that this place will break that myth. The food tasted so comforting and satisfying as it was perfectly cooked with the right spices and core flavours of Kolhapur making it right to eat and to have a mouthful of flavours. People prefer having a Thali (chicken, mutton or veg) for a sumptuous meal. However, you can explore the rest of the menu and won\u2019t be disappointed. Chicken Kharda, Mutton Ghee fry and Kheema is something that you must try. We would especially talk about the \u2018Jawar Bhakri\u2019 which was served hot and is specially prepared by the women staff they have hired from the native Kolhapur to give you the perfect \u201cAaichya haatachi bhakri\u201d. You\u2019re served with \u2018Gud\u2019 (jaggery) at the end of the meal\n.\n#foodreviewonline #maharashtra #mumbai #foodie #foody #maharshtrian #thali #thane #mumbaikar #foodofmumbai #indian #food #goodfood #goodvibes #cosy #kolhapuri #mutton #chicken #yum #tasty #instafood"],
