    "schedule_status": "Closed Opens at 12:00",
    "reviews": ["Today I had an off so I decided to and sit somewhere and chill for sometimes.So I have this very amazing place in mind.I have ordered cheese nachos,Cheesy pizza pockets,Oreo Decadence waffles.Omg so much of cheese .I am a big 2 lover .Every dish is worth the price.I loved each and every dish.I would love to recommend this place to everyone.For me from service to food and quality it's 10\/10.Thank to Mr Surender and the other staff for service and delicious food.", "good place to visit for ice cream , waffles and freakshakes", "Location: Shop 5, Brindavan Apartments, Link Road & Yogi Nagar Road, Borivali West, Mumbai.\nCuisine: desserts\nAverage cost: 300 for two people (approx.)\nWorking hours: 12 pm \u2013 11:30 pm\nDisabled friendly: no\nOutdoor seating: yes \nValet parking: no\nCredit card payment: yes \nTakeaway: yes\nFree wifi: no \nKids friendly: yes \nVegetarian only: yes\n.\nWhat we love here: waffles, fries, freak shake, nachos.\nWhy visit: they offer a meal combo where you can choose fries or nachos along with a dessert or beverage. They serve some sugar free ice cream which is a good option for health conscious people. .\nLocation: 4\nTaste: 5\nQuantity: 4.5\nPresentation: 5\nAmbience: 4.5\nHygiene: 5\nService: 4.5\nCost: 4\n.\nOur review: 4.5 \/ 5\nCream Lounge is a teeny place which is come up in Borivali West. It is designed in vibrant colours making it look pretty and radiates happy vibe. There is no seating arrangement in the inside, however, they have chairs outside for their customers. The staff is attentive and polite. The menu is broad with good options for your sweet tooth. You also have some options for fries and nachos to balance your palate with savoury. The waffles and the freaky shakes are really tempting. The ice cream flavours offered are interesting. Cream Lounge is a place you need to hop in for some mouthwatering desserts after your meal.\n.\n#foodreviewonline #staunchtravelerofficial #foodie #foodlover #foodaddict #foodblogger #food #foods #snacks #foody #foodgram #foodislife #foodlovers #foodielife #foodpic #yum #tasty #foodblog #foodshare #foodaholic #foodspotting #goodfood #healthyfood #instafood #foodcoma #foodporn #foodofmumbai #mumbai #instagood #goodvibes"],
