    "schedule_status": "Closed Opens at 19:00",
    "reviews": ["Jade Bowl is one of the better restaurants at Eskay Resorts, their service is very good and you have a lot to choose from when you orderWe were a big group so we tried a lot of dishesFor starters we ordered Cha chu Paneer, Thai Corn Cakes, Nam Rice Crispy and Paneer Kadhai Fingers. Each of them had a unique flavour and were well made. My favourite was the Paneer Ladhai Fingers, this dish is a must try!For mains we had Tempura Donburi Rice, Paneer Tikka Masala with Butter Naan, Mee Goreng Noodles and Hyderabadi Biryani. The Mee Goreng Noodles had a great taste that keeps you going back for more. I also really liked the Paneer Tikka Masala which was paired well with the perfectly made Butter Naans.Jade Bowl also has a wide variety for Desserts. We tried the Opera Cake, Gulab Jamun Cheesecake and the classic Sizzling Brownie with Ice Cream. All of these were just Yum!For Mocktails we had Lychee Punch, Fruit Punch, Bombay Summer and smoothies. They paired perfectly with the food and my personal favourite was the Fruit Punch!I highly recommend you give Jade Bowl a try!", "This place is a hidden heaven for all the foodies who would like to dine in at a lavish & splendid exotic view situated in a resort. Specifically talking about \"The Jade Bowl\" brought joy and sheer satisfaction for the taste buds. Starters-Dahi Kebab:Amazingly soft and melted in the mouth flawlessly. Tulsiyani Paneer Tikka:Very soft and nice in taste. Green Colada Mocktail:Topped the charts in mocktails section with a dash of coconut taste and garnished in a beautiful manner. Fruit Punch Mocktail: Had a good taste and again it's presentation stole the show.Mango Pineapple Smoothie: The perfect combination of mango and pineapple made its presence equally delightable. Mains-Bukhara Wali Dal:Daal adorned with dry fruits and nice in taste. Kashmiri Dum Aloo: I have travelled at many places in Mumbai and it's difficult to find authentic tasting Dum Aloo but this place busted my myth.Mains were offered with various kinds of breads where I chose to be served with Garlic Naan.Desserts- Chocolate Cheese Cake:Very soft and tasty to the hilt.Gulab Jamun Cheese Cake:Presented in a unique style with gulab jamuns stuffed in a round shaped covering shell filled with cream inside. In a crux this is a sure thing that not many of Mumbaities might have explored this place and will surely like it if you wish to feel the fresh air of vegetarian dishes served by a hospitable staff and a place that fits all the age brackets.", "Loves the food & the ambiance of the place good family restaurant"],
