    "schedule_status": "Closed Opens at 11:00",
    "reviews": ["Sbarro having around 20 outlets in Mumbai. This place serves you delicious Pizza and some lip smacking dishes. Yesterday I place an order for sbarro pizza....had variety of pizza along with Ice tea, chocolate muffin and soft Garlic bread, outlet serves veg as well as nom veg food. Impressive & proper packaging it's a key highlight, also they provides you packed sauces, pizza toppings with your order! This Malad outlet located at ground floor of hypercity mall. Coming towards delicious pizzas New York Cheese Pizza topped with cheese and it's a treat for all cheese lovers. Next one is Tomato Basil & Cheese Pizza, topped with fresh slice of tomatoes and basil leaves combine with perfect amount of cheese. Veg supreme pizza topped with veggies, corn, olives etc. these toppings are the perfect chewy & soft... Last one is peri peri paneer pizza topped with soft and fresh paneer it tasted really well!!! If you are looking for snacks they have some tasty garlic bread sticks, also serves drooling chocolate muffin and Ice tea for refreshment.. Sbarro is the best option when it comes to having a good pizza meal while being in the comfort of your home, definitely recommended, who are lover of Pizza's they will surely love this place!!!", "SbarroOrdered pizza, pasta & garlic bread from sbarro and i was very satisfied and happy with the food 1) Chicken Kabab PizzaTasted amazing had onion, jalapenos & kebab chicken as toppings.Tasted amazing & definitely a must try.2) Chicken Pepperoni PizzaWe all love pepperoni pizza and this one was definitely a must try.3) Chicken Supreme PizzaTopped with pepperoni, sausages veggies and a lot of cheese.Super good and super nice.4) Peri Peri Chicken pizzaSome spiced peri peri chicken topped on pizza with a lot of cheese.Had a definite spicy taste and definitely amazing.5) Milano Chicken Pasta I love the white sauce pasta with lots of cheese & veggies.This one was definitely a must try and tasted super delicious.6) Garlic Bread (1 portion)Classic garlic bread baked amazingly.I had it without any sauce, ketchup mayo and still it tasted amazing", "If you are tired from shopping in hypercity and want to enjoy pizza then it's right place to visit, but sincerely speaking dont expect toooooo good taste of pizza here, ambience is ok, food quality again ok but yes you can atleast eat and meet satisfy your hungerness, good place for friends who love to chitchat and its not place for family as personally i feel ambience and sitting arrangements is not good, staff not attentive at all, slow service as well. Rest what say its depend how to look out it. If you wany you can try it atleast once."],
