    "reviews": ["Great Place..Loved the concept!", "Sigree has good ambience, amazing food, wide variety and very courteous staff", "Location: Unit 812, 8th Floor, Palm Spring, Next To D'Mart Store, Link Road, Kanchpadha, Malad West, Mumbai\nCuisine: north indian, turkish, lebanese, greek\nAverage cost: 1900 for two people (approx.)\nWorking hours: 12 noon \u2013 3:30 pm, 7 pm \u2013 11:30 pm\nDisabled friendly: no\nOutdoor seating: no\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: no\nKids friendly: yes\nVegetarian only: no\n.\nWhat we love here: pizza, fish, biryani .\nWhy visit: to enjoy a tasty buffet meal which includes huge varieties of food with some unique cusines and with a lavish ambience.\n.\nLocation: 4.5\nTaste: 4.5\nQuantity: 4.5\nPresentation: 4.5\nAmbience: 4.5\nHygiene: 4.5\nService: 4.5\nCost: 4.5\n.\nOur review: 4.5 \/ 5\n.\nSigree global grill is located at Malad. It is a kind of buffet restaurant. The ambience is vast and impressive with good interior design done on walls and a circular roof lighting giving this place a royal look. There is a see through kitchen where chef can be seen preparing the delicious food and then it gets served on the buffet table. They have a dedicated area for snacks, popcorn and chaat. The staff is responsive and quick on reloading the food as soon as the food container is about to get empty. Such unlimited food has large varieties from cuisine of North Indian, Turkish, Lebanese and Greek, so eat as much as you can. There is also live music which is euphorically performed by talented artists which adds to the overall experience taking the buffet experience to another level. We tried the fish curry which is a must try, then we had chicken biryani and some cupcakes. Make sure you develop an appetite or come with an empty stomach before entering this place. The grill starters are also on point with their taste and it should be that\u2019s what the name of this place say. Overall if you are looking to have a lavish meal at highly affordable rate and with a good appetite then this place is just for you."],
