    "reviews": ["A very well known place on the Goregaon Link Road is this terrace and roof top restaurant. Loved the ambience totally and the place overall. The service is quick and hospitality is decent as well. Check out what we had here:Masala Crispy RoomaliHuge roomali roti, baked till its crispy. Topped with a tomato onion masala, this crispy treat is sure to have while you chat with your buddies.Paneer Ajwani TikkaPaneer tossed in a medium spicy masala with pepper, tomato and onion. Loved the taste and would surely recommend.Atishi AlooBaby potatoes tossed with a spicy masala and salad is a dream come true for baby potato lovers. Every piece is perfectly barbequed and heated with a magic masala.Subz Deewani HandiMix vegetables in a creamy tomato medium spicy gravy is a no misser at this place. Perfectly created non-paneer vegetable is a treat to your tastebuds.Subz Dum BiryaniA decent dum biryani with great aroma and dum aloo stuffed with other vegetables. A very decent option for vegetarians wanting to have biryani.Shahi TukdaTopped with rabdi, this sweet is the best way to end your meal. Totally droolworthy and a must order.Pina coladaPinapple and coconut is a classic combo to sip on and a must have alongside your mealVirgin mojitoThe best quick quencher with mint and soda to rejuvenate your mood and kick out the unseasonal heat", "An open space enjoy the natural breeze. Usage of deewan space and a cozy corner. All built in to relax and enjoy the taste buds flittering to eat more. Must try kasbah falooda, chakli kebab, chicken buraha, dal fry, chicken korma, chicken platter, chicken laziz, blue lagoon, fruit punch& virgin mojito.", "Place is Gud  but service is slow"],
