    "reviews": ["Excellent service and attention to detail.. and Food.", " One of the best North Indian food that we have had in a long time. Bhatti Da Murg as a starter was just fabulous and we couldn&#039;t wait to get the other dishes. The stuffed Mushroom - Tandoori Bharwan Khumb was absolutely fabulous. Masaledar Jhinga and Kheema Naan was absolutely delicious. We ate a lot and couldn&#039;t stop eating. The Gulab Jamoon was light on stomach and very delicious. Definitely looking forward to visit again to try the other dishes! ", " It&#039;s difficult to locate this place; Google map leads to the back of the place. Anyway, we went on Dussehra and it was packed . We were asked to sit in the adjacent bar; slowly that also became full.\n\nWe ordered bantewala soda and lassi. The soda was good but the lassi was like a meal in itself. It was thick and full of nuts and malai.\n\nWe ordered chicken malai tikka with kulcha for starters. The kebab was really good and the kulcha was good too. We also ordered the Peshawari kebab- it was delicious too\u0964 The chicken was soft and succulent.\n\nFor mains, we ordered a biriyani and rmutton Rogan Josh. Rogan Josh was good, but the biriyani, which was claimed to be &#039; dum pukht&#039; biriyani, tasted quite unlike the aromatic biriyani we wanted. "],
