    "schedule_hours": " 10:00 - 01:00",
    "reviews": ["The culinary  tales is the best place to have dinner ..The hospitality and number of  dishes and the speciality in main course       and mocktail     variety was too many and the recommendation also helps the lot              Shakes followed by mocktail and main course is the best way to end the day..The quality of food was marvelous..and the hygienity was also maintained..which is the best part of this place..    The ;-Banana Hany Walnut ShakesMint Orea ShakePastiza Pizza vegHerb Cousted Cottage cheese Sizzler          Cron FritterMojito black currentMojito lemon    Bubble gum cookLendl hot chocolate  Kung pao panner  Cheese bits     This were the number of dishes we have tried and believe me the taste was awesome and to yummyy and too good umhaa..... healthy and proper hygiene is been geusturized...", "Had a visit last night to this awesome place I loved the food taste quality and ambience of this place. Located very near to Azad nagar metro it was very convenient to visit.We ordered a couple of milkshakes- Disneyland : ****** must try A cool freakshake with milk strawberry and fresh cream was real innovative and real good- Death by choclate : being a chocolate lover I just full in love with this it was a freakshake with loads of cream and chocolate it was a good experienceI must say both were awesome I really wish to try all of them but these were real goodI also tried some nonveg food I love they taste of each one of itMeaty mix sizzler : I must say that it has been one of the best sizzler I have tried in Mumbai crisp tasty well made very well presentedCheese and chicken fitter : I just loved the sauce they presented with the cheesy fried chicken and will be a good one for fried Chicken loversTo end this amazing experience I ordered the dessertRocky road waffle :****** must try filled with dry fruits and choclate topping it was something that made a happy ending to my mealI just loved the ambience and the service was pretty good also a nice place to sit and have a relaxing time the have indoor and outdoor seating as well", "Recently visited this place in Azad nagar(mumbai) with the recommendation of my friends and after visiting and having food at this place was totally worth it because of the kind of the service from the staff and the quality of the food along with the food decor was just amazing..The ambience was quite fascinating along with the lighting's and the low music in the back was just the perfect combi along with the food..The food we ordered here was:-1)Banana Honey walnut shake(highly recommended)2)Mint Oreo shake(taste of mint at the end after sipping, definitely something new)3)Cheese bites4)Pastiza pizza veg(recommended)5)Herb Crusted cottage cheese sizzler(try in ricebase rather in smashed potato base)6)One pot pesto pasta veg7)Kung Pao paneer8)Corn fritters9) Blackcurrent mojito10)Lemon mojito11)Bubble gum mojito12)Lindy Hot Chocolate (A must must must try thing and would higy recommend this for coffee lovers)..Over all a GREAT experience ,would visit here again and again..Food taste:5\/5Value for money:5\/5Hygiene:5\/5"],
