    "reviews": ["Nice place.Brownie Crumble, Double Trouble, Chocolate Therapy are a must try for Chocolate Lovers.", " Nothing hits the spot like those warm chocobomb does. I do feel the quality going down over the years but it\u2019s still my favourite. Dark fantasy is good too. However the fillings inside is becoming less and less. Initially it used to be ozone out chocolate but now it\u2019s just a spoonful which u get in just 2 or 3 bits. Please don\u2019t mess with the quality and standard if u wanna beat the competition :) ", "Every bites were fully loaded with chocolate and it was melting in my mouth they have nice combos of donuts also i had 2 boxs in which one of them was of mini 18 donuts and second was of 6 donuts????.\nThey also have manny varieties of donuts and much more. They also have waffles, eclairs and shakes etc.\n.\n@madoverdonuts\nFollow Foodicted_tj"],
