    "schedule_status": "Closed Opens at 11:00",
    "reviews": ["Beating the heat and so many flavours to chose from enrich kulfis !!! Kulfi is a indian dessert or Indian icecream which is made with milk and a lot of dry fruits Kulfis indeed take us back to the nostalgic moments of childhood The sugar content was also perfectly balanced Order - Bamboo sitaphal kulfi - It has a soft texture with perfect glench of sitaphal taste in it Gulab jamun cone kulfi - This kulfi was one of my favourite also it has gulab jamun in it .Dry fruit cassata kulfi - Major hint of cardamom and pistachios and nuts .Bamboo red Peru kulfi - Red peru + Red chillies salt .Sweet and spicy .This was really mouthwatering Anjeer kulfi - I love figs so much that even when it comes to having kulfi, anjeer kulfi will always be my first preference", "Want to have some yummy fresh and quality kukfis head to this place as it has some amazing and yummy one's on their list.As they have wide range of kulfi out there on their menu for your sweettruth.As I had ordered few kulfis from here...Pan masala kulfi:- As this was one of the one's which I totally loved.Millineum kulfiDry fruit cassata kulfiRose badam kulfiOverall a good place to enjoy your kulfi and a must try on.", "ENRICH KULFI! There are certain dessert places, which leave an impact on you, at times! This happened with me, when I tried the Kulfi from Enrich Kulfi! They have a lot of different varieties of them, and the freshness in them, is amazing too! I totally loved the Gulab Jamun Kulfi, wherein, a whole Gulab Jamun was stuffed inside a Kesar Kulfi, and the flavour of Kulfi was quite immense in it! Loved this one, completely!I also liked the Rabdi Malai Kulfi, which was polished off within seconds! The flavour of Rabdi, and Malai, was just perfect! I liked the Mango Kulfi too! All in All, the Kulfis here are amazing! I hope they open up in the Lokhandwala Stretch too! I am definitely going to order in the other Kulfis!"],
