    "reviews": ["Limited space with unlimited tasty dishes. Mostly crowded place , on demand menus. Well manner customer queing. We ordered 1 pint beer, 1 half tandoori , munchow soup &  famous chicken paprika as main course.very good for family & friends dine out. Use zomato gold if u have.", " The food is always amazing ! Just writing this review to appreciate the amazing staff and service especially the guy with light coloured eyes! He was damn sweet and waved us while we were leaving. Just wanted to appreciate the gesture! You guys are doing it great!  ", "Location: Shop 1, Opposite Veda Building, Near Bhavdevi Garage, Holy Cross Road, IC Colony, Off New Link Road, Borivali West, Mumbai\nCuisine: mexican, italian, north indian, chinese, european \nAverage cost: 1600 for two people (approx.)\nWorking hours: 1 pm - 12 pm \nDisabled friendly: no \nOutdoor seating: no \nValet parking: no \nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: no\nVegetarian only: no .\nWhat we love here: mocktails, nachos, kiwi punch, tiramisu, potato mash, iced peach tea, caramel custards.\nWhy visit: if you are looking for a sports bar with delicious food then you must try visiting here.\n\nLocation: 4.5\nTaste: 4 \nQuantity: 4\nPresentation: 4 \nAmbience: 4.5\nHygiene: 4.5\nService: 4.5\nCost: 4.5\n.\nOur review: 4.5 \/ 5: \nThe Fusion Kitchen located in Borivali west is known for serving appetizing food and a menu variety you generally won't find elsewhere. This place has beautiful interiors with a bunch of sayings and catchy pictures. Food & drinks served here are appreciated & loved by mostly all who visit. The Staff and the service given by them is very good. This place is a perfect venue for going out with friends and enjoying live sports. Pescado Con Guisantes, Lebanese Garlic Kebab, Mojo Criollo Chicken, Jamaican Jerk Kebab were some of the suggestions given by the staff. Flower pot surprise, S\u2019mores peanut butter and caramel custard are the most recommended Desserts. Chicken sriracha was very delicious, spicy and tangy. It may seems like a small place, but is quite spacious inside. Good collection of imported beers. It's one of those places where u can visit many times and keep trying different foods everytime. \n\n#foodreviewonline #staunchtravelerofficial #foodie #foodlover #foodaddict #foodblogger #food #foods #snacks #foody #foodgram #foodislife #foodlovers #foodielife #foodpic #yum #tasty #foodblog #foodshare #foodaholic #foodspotting #goodfood #healthyfood #instafood #foodcoma #foodofmumbai #mumbai #instagood #goodvibes #share"],
