    "reviews": [" Masala Mastee - A rating of 4.6 when we thought of visiting it. Plus it had Gold Benefits as well. Below is my detailed review:\n\nGood things:\n1) Amazing Mocktails, we had ordered 4 mocktails, and all of them were super awesome. Their Orange Mojito is a must try.\n\n2) Hummus Platter rocks big time.. 3 kinds of Hummus and they have the best Pita Bread as well, couldnt ask more out of it.\n\n3) Vada Pav Fondue was very good as well. Wasnt excellent, not sure what else could&#039;vd been changed, but have had better at many other restaurants.\n\nBad things:\n\n1) As soon as I sat on my table, I told waiter that I had Zomato Gold, immediately he said, that we wont be able to take the benefits until end of Diwali. And that completely pissed me off, as there were no such terms and conditions mentioned anywhere, after I argued, eventually he did let me take the benefit.\n\n2) Deep Dish New York Style Pizza - It is a complete No-No. One of the worst Pizza&#039;s I&#039;ve ever tasted. Complete waste of money there.\n\nPS: I wanted to give 3 stars, but the +1 is completely for the singer, who was performing live. He was just super awesome. ", " Location: ???? Masala Mastee, Borivali West. \n.\n\nWhat we ordered from the menu:\n\u2022Mocktails:\nWatermelon Twist\nCrime Master Go Go\n\n\u2022Starters :\n7 Layer Mexican Shots\nSpicy Peri Peri Tikka\n\n\u2022Mains:\nIndi - Chinni Sizzler\n\n\u2022Dessert:\nChocolate Cocoon\n\n.\nMasala Mastee is a vegatarian restaurant serving a variety of cuisines. They have quite a lavish menu. The ambience was really nice and the music was really great. Right from the mocktails to the dessert everything was so perfect. The staff was very friendly and the service was quite good. \n.\n\nService - ????????????????????\nValue for Money - ????????????????????\nTaste - ????????????????????\nOverall - ????????????????????\n.\n\nStick around for upcoming posts! Happy hogging! ???????? ", " Have different cuisine with unique twists ... Never had nachos served with shots of variety of sauses... Appealing ambience and delicate mocktails "],
