    "schedule_status": "Closed Opens at 11:00",
    "reviews": [" Ok, so here\u2019s my review. It was my wife\u2019s birthday and we decided to take her and my boys for sea food. Positives first - great interiors, helpful staff\nNegatives - while we knew the place was slightly on the steeper side, what was disappointing was the size of the portion. We had ordered pomfret rawa fry for the kids which didn\u2019t justify the price. Anyways, that was not the worst part, in the middle of the night my 8 year old boy started puking and my wife suffered stomach infection. Food infection is what our doctor told us. Not a very happy birthday indeed. Trust the management will read this and ensure similar thing doesn\u2019t happen to other customers.  ", " Tasty food with good proportions served. However, you may want to ask them to tone down the spicy-ness when you order for the tandoori and ghee roast stuff.. very courteous staff.. definitely would recommend all seafood lovers to visit at least once..  ", " Located in Evershine Nagar - Malad West, I loved the location & ambience.\nFirst we tried :\nSurmai Tawa Fry :- Cooked perfectly with exact proportion of masala & rightly coated with Rawa.....Loved It\nPomfret Fry :- Same as above but size of Pomfret was too good for 2 of us....very satisfying.\nBombil Fry :- It was the last decision to order this & for our surprise it was the best decision, perfectly crispy & the meat was tender....Loved it the most\nPrawn Ghee Roast With Neer Dosa :- The reason I didn&#039;t gave 5-Star is because of this dish, I felt like prawn was cooked in the left over fish Marination as the taste was just like red chilli paste....Skip it when you visit.\n\nOverall very satisfied with the ambience, food & courteous staff....Will definitely visit again. "],
