    "schedule_hours": " 09:30 - 03:00",
    "reviews": ["A place located in Oshiwara is a heaven for all the dessert lover out their. It's more of a Delivery outlet but it does provide you with seating option.Food: It is more of a Dessert place which provides you with various types of Milkshake\/Ice cream Sundae and Juices. Along with that they have two other options of eating either a Roll or Sandwich. I tried:1. Veg Tandoori Tadka Cheese Grill Sandwich: It was one of the most amazing sandwich I have ever had. HIGHLY RECOMMENDED.2. Ferrero Rocher Shake: You could get the flavour of Ferrero Rocher with every sip you take.3. Paradise: It does stand by it's name.4. Fizzilicious: This is something I have never had before. I loved it.5. Crispy Mountain Ice cream Sundae: It was the best way to end my day.", "shakey wakey is located near andehri west and the name sounds cool (shakey wakey)They serves shakes,roll and sandwich etc.We tried:-Chicken tandoori sandwich   :-is wonderful appetizer where mouth watering grilled tandoori chicken pieces and the taste was also good Butter chicken roll:-the warming flavour of butter chicken roll is perfect  and the size of the roll is also good.D x B : the juice was unique and tasty .Overall my experience at shakey wakey  was great.Liked the food , service and ambiance.We enjoyed here's food and drink\u2019s Awesome place .... Highly Recommend!!", "Shakey WakeyVisited Shakeywakey oshiwara with friends for a quick bite and here is my Experience with them-->Shakey Wakey is Located in Oshiwara andheri westThis place serves a Variety of icecream, shakes, rolls, sandwiches etc and huge menu to try fromThe staff here is quick and responsive. They did their job the best.The ambience is cozy and small het worth it.The dishes are fresh and hygenic. The cafe too is hygenic.The food is totally value for money.We orderedThanda thandaIt was a Great refreshing drink with watermelon and muskmelon flavour. It was chilled.Pink Lemonade The flavours of lemonade in shades of pink it was chilled amd refreshing drink. Chocolate chip ShakeThe thick and great blend of chocolate chips and thick milkshake. Loved this one. Nicely decorated and served.  ( Highly recommended) Chicken Tandoori RollThe Roll was nicely stuffed with chicken tandoori sauce and chicken soft pieces with an omlete inside it. It was in good quality and quantity. Chicken Club Sandwich The sandwich was stuffed with omlete and some kind of white sauce. Nicely served with shezwan sauce. Choco Mountain ( Sundae) It was a glass full of vanilla icecream and some cashews and other dry fruits..  Topped with lots of chocolate sauce and chocolate cream.Overall the food was good and service too.I recommend you to visit this place if you are a dessert lover like meFood-5\/5Service-5\/5Ambience-4\/5"],
