    "longitude": 72.8338229,
    "address_formatted_short": "G1, 108, Ground Floor, Morya Classic, Andheri - West",
    "rating": "#31 of 23220 restaurants in Mumbai",
    "rank_type_id": 5,
    "top_ratings": ", Seafood",
    "phone": "(+91) 2262366323",
    "website": "http:\/\/www.olivebarandkitchen.com\/",
    "address": "G1, 108, Ground Floor, Morya Classic, Andheri - West, Mumbai, Maharashtra, India",
    "price_score": 5,
    "cuisines": "Asian",
    "schedule_status": "Closed Opens at 12:00",
    "reviews": ["So visited this outlet, Fatty Bao, in Andheri. They also have another outlet in Bandra. Fatty Bao is an Asian cuisine restaurant that is famous for its bao. There are lots of Japanese, Chinese dishes to choose from. They are undergoing a china town celebration. Do try out there limited edition dishes out there. The ambiance of the place is top-notch. Beautiful elegant decorations. It is a fully Japanese themed based restaurant. The staff was very friendly to us. The food was amazing with lots of dishes and a beautiful presentation of each and every dish. What to order?Cocktails:- Risky whiskey:-This is an amazing whiskey-based cocktail! The taste is just outstanding. Whiskey and Lime juice combination is great in taste. Do have a try out here. Cool-ade Cocktail:-A gin-based cocktail is a must try out here. The flavor of gin is superb. The taste is just wow. The presentation of this cocktail is amazing. Go for it. Starters:- Kimchi potatoes:-The must-try starter for all the vegetarian lovers. Kimchi potato is a medium spicy dish with chilly and tangy sauce with it. The taste is lovely and great. Fried potatoes were great.Cottage cheese Spicy Bao:-This is a go-to dish. The bao contains an amazing spicy cottage cheese. The paneer pieces were very soft. Do go for it. It also came with Tadka chutney black colored. I totally enjoyed the dish. Main course:-In the main course, we tried there limited edition china town special dishes.Pan tossed Fried noodles:-These noodles came with amazing Korean gravy and noodles with exotic veggies. The taste was just superb. Noodles inside the gravy was simply delicious. Would recommend it to all. Hong kong style Clay pot rice:-The presentation of this dish was just great.The rice in a clay pot with exotic veggies was simply amazing. This also comes with chicken variety. It was a little spicy but very good in taste. Go for it.Dessert:-The best part of the dessert was amongst the fatty bao special and it was. Japanese cheesecake:-Never had this amazing cheesecake ever. It was so soft and the taste is just out of the box.  The presentation of it was also awesome. Would recommend everyone to have it. Japanese cheesecake has two layers of cheese on the top and light in taste. Coco caramel:- One of the unique dishes I have had in a long time. The presentation of this one was very different. They had cocoa pieces. The caramel chocolate scoop ice cream was lovely. Do go for this fatty bao special dessert. Recommend to all of you do visit fatty bao.  Nonveg lovers have an excellent variety of food over here. Go try it out now!.", "The food here was pleasant. We ate crab cake bao, chilli chicken and seafood- via ?malaysia ramen .. the food was very good. Must visit for a cosy vibe and comfortable food..", "THE FATTY BAO - FOOD REVIEW ONLINE (FRO)\n\nTHE FATTY BAO - FOOD REVIEW ONLINE (FRO)\n.\n.\nLOCATION: Andheri West - Mumbai\nCUISINE: Sushi, Asian, Thai, Vietnamese, Malaysian\nAVERAGE COST: 1800 for couple (approx.)\nWORKING HOURS: 12noon \u2013 3:30pm, 7pm \u2013 1am\nDISABLED FRIENDLY: NO\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO\n.\nWhat We love here:\nSushi, Dumplings, Cocktails, Fatty Hill, Crispy Beetroot Fatty Bao, Fatty Lotus Root, Exotic Vegetable & Silken Tofy\n.\nWhy Visit: If you want to experience Asian cuisine and the street food from the by lanes of Bangkok, this is the place that will offer you a diverse menu. Always opt for a full broth Ramen for slurpy and wholesome meal. .\n.\n.\nOur Scores\nLocation: 4.5\nTaste: 4.5\nQuantity: 4\nPresentation: 4\nAmbience: 4\nHygiene: 4.5\nService: 4\nCost: 4\n.\nOur Review: 4 \/ 5\n@thefattybaomum has promptly established its name in the Asian cuisine food chain by constantly adding and improving their menu. Their broad sushi and dim sum menu is evident to the fact that they have revolutionized the Asian appetizers. It is a cozy place with quirky interiors amidst the hustle and bustle of Linking Road making it the perfect place to indulge in for your craving for Asian food. Vegetarian dim-sum have never been this delicious. They serve soft, fluffy and spicy Bao without being too sharp, especially if you are a vegetarian. The Prawns delicacies, Spicy Mushroom Sushi, Fatty Hill desert is recommended to try. The kimchi baby potatoes were lip smacking. A very Asian street style, nice and comfortable interior will remind you of a Bangkok this place will definitely make your taste buds dance to the treat of the Asian menu.\n.\n.\n.\n.\n.\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n.\n.\n.\n.\n.\n.\n..\n#foodreviewonline #kailashshahaniofficial #mumbaifood #mumbai #mumbaifoodie #foodie #foodblogger #foodofmumbai #foodphotography #mumbaifoodies #mumbaifoodlovers #food #indianfoodbloggers #instafood #foodgasm #foodstagram #blogger #foodtalkindia #foodlover #mumbaikar #foodies #asianfood #instagood #yum #dinner"],
