    "reviews": ["Good but little bit over priced.", "Ambience is nice but it is little dark side as the lights are positioned at long distance and are of very less lumens. So disappointing for photo lovers.", "SOUL CURRY - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Powai, Mumbai\nCUISINE: North Indian, Malvani, Chinese, Italian\nAVERAGE COST: 1800 for couple (approx)\nWORKING HOURS: 12.30 pm - 12.00 am\nWHEELCHAIR FRIENDLY:\nOUTDOOR SEATING: YES\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO .\nWhat we love here: Honey Chilli Sambal Lotus & Potato, Mumba Cha Bao, Manisha's Sol Kadhi, Maharashtrian Chakna Platter, Paan Patta Cota, Chinese style chowmein, Cocktails\n.\nWhy Visit: Soul Curry is one of best Authentic Malvani Cuisine Restaurant In Mumbai\n.\nLocation: 4\nTaste: 4\nQuantity: 4\nPresentation: 4\nAmbience: 4\nHygiene: 4\nService: 4\nCost: 4\n.\n.\nOur Review: 4 \/ 5:\n@soulcurry_restaurant is multi-cuisine restaurant\/lounge in Powai, specializing in Malvani Cuisine. The place dares to combine two distinct experiences by blending together the traditional ambiance of a family dine and the sophistication of a Modern Hangout joint. The d\u00e9cor is no-frills and the seating, is spread across an inside area by the bar and an outdoor covered section. We started off Malvani feast with Maharashtrian Chakna Platter, its a mixture of Traditional Maharashtrian snacks comprising of Kotimber Vadi, Mini Vada, lasun Chatney. In appetizers we had Mumbai Cha Bao, which was a very innovative and delicious version of vada pav. The Chinese variation that the \"Bao\" brings in without changing the streetside flavors. Shabnam ke moti is another appetizer that will make your taste buds go wild! It's a great combination of tandoori mushrooms with assorted veggies stuffed with oodles of cheese. We also had lip smacking Thai Style Honey Chilli Sambal Lotus & potato was a perfect appetizer. In Mains we tried Malay Roti Canai Potato its a fusion of Indian- Malaysian cuisine. Its similar to laccha paratha served with coconut gravy with boiled potato. Lastly we had Italian panna cotta with Indian twist ! It is served on paan topped with whipped cream. It has prominent taste of paan really delicious. .\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n.\n#foodreviewonline #kailashshahaniofficial #soulcurry #powai #mumbai #foodie #foodlover #yum"],
