    "reviews": ["Friday to Sunday - they entertain only groups. If couple or 2 people visit they make them to sit on very uncomfortable seats at corner. Otherwise place is good & it's my regular place after office. Very good service, reasonable rates on alcohol.", "Location: 89, Shivani Industrial Estate, Opposite Times Square, Sakinaka, Mumbai\nCuisine: mexican, chinese, north indian, american\nAverage cost: 1500 for two people (approx.)\nWorking hours: 12 noon \u2013 1 am \nDisabled friendly: yes\nOutdoor seating: no\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: no\nVegetarian only: no.\n.\n\nWhat we love here: tri hummus platter, fantasy pizza. .\nWhy visit: india\u2019s first bar with interactive table, vr & stock exchange.\n.\nLocation: 4\nTaste: 4\nQuantity: 4\nPresentation: 4\nAmbience: 4\nHygiene: 4\nService: 4\nCost: 4\n.\nOur review: 4 \/ 5\nThe past and the future seem to converge, as the lyrics to classic rock ballads scroll across your interactive VR tabletop at Drinx Exchange designed by the Founders of Bar Stock Exchange and Agent Jacks Bar. The first of its kind, this high tech, stock exchange concept bar and restaurant is bringing people together in a fun, new way. Via their app, you can place orders, interact with your table for karaoke or cricket updates and most importantly, crash the market. They have all the bar classics plus a range of signature cocktails to tickle your fancy and a food menu that champions comfort food and will soak up all the excesses. The bar menu contains molecular cocktails to choose from besides the regular classic cocktails and finger food dishes. Some of their top recommended dishes are Tri Hummus Platter and Fantasy Pizza. Both the dishes were good in quantity and quality. Overall it\u2019s a Cool Resto Bar to experience Like Marvel Avenger with Interactive Smart Tables and Stock Exchange.\n.\n#foodreviewonline #kailashshahaniofficial #bar #dj #drinks #cocktails #music #party #bartender #food #drink #beer #club #cocktail #instagood #pub #restaurant #nightlife #mixology #dance #wine #friends #lounge #instafood #foodblogger #foodgasm #yummy #foodies #foodstagram #restobar", "DRINX EXCHANGE - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: 89, Shivani Industrial Estate, Opposite Times Square, Sakinaka, Mumbai\nCUISINE: MEXICAN, CHINESE, NORTH INDIAN, AMERICAN\nAVERAGE COST: 1500 for two people (approx.)\nWORKING HOURS: 12 NOON \u2013 1 AM \nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: NO\nVEGETARIAN ONLY: NO.\n.\n\nWhat we love here: Tri Hummus Platter, Fantasy Pizza. .\nWhy Visit: India\u2019s first bar with interactive table, VR & Stock Exchange.\n.\nLocation: 4\nTaste: 4\nQuantity: 4\nPresentation: 4\nAmbience: 4\nHygiene: 4\nService: 4\nCost: 4\n.\nOur Review: 4 \/ 5\nThe past and the future seem to converge, as the lyrics to classic rock ballads scroll across your interactive VR tabletop at Drinx Exchange designed by the Founders of Bar Stock Exchange and Agent Jacks Bar. The first of its kind, this high tech, stock exchange concept bar and restaurant is bringing people together in a fun, new way. Via their app, you can place orders, interact with your table for karaoke or cricket updates and most importantly, crash the market. They have all the bar classics plus a range of signature cocktails to tickle your fancy and a food menu that champions comfort food and will soak up all the excesses. The bar menu contains molecular cocktails to choose from besides the regular classic cocktails and finger food dishes. Some of their top recommended dishes are Tri Hummus Platter and Fantasy Pizza. Both the dishes were good in quantity and quality. Overall it\u2019s a Cool Resto Bar to experience Like Marvel Avenger with Interactive Smart Tables and Stock Exchange.\n.\nDon\u2019t forget to follow our handle @foodreviewonline and for more such detailed restaurant reviews visit us on www.foodreviewonline.com.\n\n#foodreviewonline #kailashshahaniofficial #bar #dj #drinks #cocktails #music #party #bartender #food #drink #beer #club #cocktail #instagood #pub #restaurant #nightlife #mixology #dance #wine #friends #lounge #instafood #foodblogger #foodgasm #yummy #foodies #foodstagram #restobar"],
