    "reviews": ["The hashtag by H&A is one of the best Burger & Pizza serving hotels.This hotel is located in Sakinaka.Near by sakinaka I'm metro stationThis is a fun place where you can eat items like pizza burger pasta.This place is known for the Unlimited Burger Challenge.We ordered some dishes on this viz.Drinks\u221a Choko Moka -its was good drinkburgerJuicy LucyStuffed ChickenAll the burgers were goodpizza\u221atutte le carniIf seen, the experience of this place was a fun experience.And the service here was also very good.Those who like pizza and burgers can go here once", "I personally didn't like the non veg burger. The patty was too small and mayonaise content way too high than needed. One could only taste the sauce. The portion of fries were less. The chocolate shake was good.", "HASHTAG BY H & A\n.\nLOCATION: Parijat Towers, Shop 8, Sakivihar Road, Opposite Sun Srishti Building, Sakinaka, Mumbai.\nCUISINE: FAST FOOD, PIZZA, BURGER, DESSERTS, BEVERAGES\nAVERAGE COST: 700 for two people (approx.)\nWORKING HOURS: 12 PM \u2013 11:30 PM\nDISABLED FRIENDLY: NO\nOUTDOOR SEATING: NO \nVALET PARKING: NO\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: NO \nKIDS FRIENDLY: YES \nVEGETARIAN ONLY: NO\n.\nWhat We love here: Pasta, Burgers, Pizza, Peri Peri Chicken Burger, Chips, Waffles, Choco Strawberry.\nWhy Visit: If you are craving for some fresh home-style Lasagna do visit this place.\n. \nLocation: 4.5\nTaste: 4.5\nQuantity: 4.5\nPresentation: 5\nAmbience: 5\nHygiene: 4.5\nService: 4.5\nCost: 4.5\n.\nOur Review: 4.5 \/ 5\nHashtag by H&A is a newly opened and trending cafe situated at Sakinaka. A good pop style Cafe for quick bites serves a variety of dishes. The ambience is chic and inviting with wall frames, lights and seating arrangement giving great look to this place. They have a perfect and attractive combination of wooden table and comfortable chairs to seat. The staff here is well versed with the menu, courteous and good with recommending dishes. This is a cafe with a range of good food right from fries, wedges, burgers, Pizza to main course options shakes, freak shakes and drool-worthy desserts, waffles and an amazing range of cakes baked in-house. Not only the food is delicious, but it is also filling. We appreciate the serving portion, it is a complete value for money. The owner of this place is usually available here and keeps a personal check on the service and the food. Hashtag with its appetizing food, good ambience and superb service is a place you should visit.\n.\n#foodreviewonline #staunchtravelerofficial #foodie #foodlover #foodaddict #foodblogger #food #foods #snacks #foody #foodgram #foodislife #foodlovers #foodielife #foodpic #yum #tasty #foodblog #foodshare #foodaholic #foodspotting #goodfood #healthyfood #instafood #foodcoma #foodporn #foodofmumbai #mumbai #instagood #goodvibes"],
