    "reviews": ["Nice hangout, with good food!", "great ambience...food is also good...", " Ambience - 5\/5\nHospitality - 4\/5\nService\u00a0 - 4\/5\nFood - 5\/5\n\nOrdered - Chimichuri chicken dumplings, prawn in chilli beans sauce, thai spring rolls, Sri Lankan Devil (chicken and veg both), veg noodles.\n\nWhat we liked - Everything. (Note, SriLankan Devil is just like Khow Suey)\n\nOne of the nicer places in Mumbai to come for Asian food. Visited with my office colleagues for a colleague&#039;s farewell and it was totally packed. There was not a single table empty and this restaurant has opened not too far long ago speaks something about the quality there.\n\nThe ambience is very good with courteous staff all around. Since it was a full house the orders took way too much time to arrive, some orders got mixed up as well. But the taste compensated for it.\n\nOverall a good place to visit if you want to have some good Asian food in Mumbai. "],
