    "reviews": ["Great food, wonderful ambience, Small pav with garlic butter is awesome", "Major mischief delivered in the most beautiful fashion. The restaurant has delivered the super combinations of two very distinct flavours- the spicy and tangy Indian flavour juxtaposed with the delicate Italian varieties. The restaurant opened it wings in December and has been running full steam. Also, modelled on the style of an open cafe in a mall has worked in its favour.We were here for a Sunday dinner and the place was brimming with people. The modular set-up has a a small portion to artefacts which is used for sales. Our orders were totally based on the recommendation of the manager - Masala Cheese Pasta and Dum Murgh Risotto.Masala Cheese Pasta- the pasta has abundant flavours of spices tending towards a Masala chole and Dal Makhani combo and seriously good. The topping of various colored Capsicum gives it a refreshing taste. The hint of cheese dilutes the spicy flavours a bit but still does not overpower it. On the pasta side, a bit more boiling was required.Dum Murgh Risotto - a perfect mix of flavours - Chicken cooked in Indian flavours topped with rice and served boiled rice and some vegetables. The food is healthy yet delicious and the presentation is neatly organised. A thumbs for the dish.The portion size is good for one single person and the pricing is moderate. Visiting this restaurant is dependent on our frequent visits to the mall. Albeit a good show.", "Location: Phoenix Marketcity, Kurla, Mumbai\nCuisine: international cuisine\nAverage cost: 1200 for two people (approx.) working hours: 12 noon \u2013 1 am\nDisabled friendly: yes\nOutdoor seating: no\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes\nVegetarian only: no\n.\nWe love here: \nPizza, pasta, cheesecake, cocktails, club sandwich, salads, veg risotto\n\nWhy visit: if you\u2019re someone who loves to feast on pizza and want to try something other than the usual pizza outlet, you must visit this place for a delightful experience. .\n.\nOur scores\nLocation: 5\nTaste: 5\nQuantity: 4.5\nPresentation: 4.5\nAmbiance: 5\nHygiene: 5\nService: 4.5\nCost: 4\n.\nOur review: 4.5 \/ 5\nThe Market Project by Pizza express is located in one of the most visited malls in Mumbai @MarketcityKurla. Being located on the ground floor, it allows you to shop or window shop at the mall and they will surely grab your attention towards it. The place has a warm appeal and as you enter the place the appetizing aroma of the cheese and coffee will make hit you which is invigorating. The Dhania Pesto Chicken Romana was lip smacking. The perfect thin crust is to be rarely found that they serve you. The chicken chunks were luscious and perfectly spiced. This place definitely puts down all the other pizza outlets. The next we tried was their chaat which was scrumptious. The Market Project by Pizza express menu is a must visit place if pizza lovers. To add to the great experience was a live music event at the place which kept us accompanied. Not to forget the staff, who are extremely courteous and always at your service, KUDOS! to their spirit. Great food, good ambiance, and amazing staff are all that you need for time well-spent experience.\n.\n#foodreviewonline #foodie #foodlover #foodandwine #foodaddict #foodbloggers #foods #food #foodaholic #foodblogger #MarketcityFoodies #MarketcityMumbai #foodphotos #foodofmumbai #foodpost #mumbaikar #mumbai #mumbainightlife #mumbaifoodies #mumbaifood #mumbaiblogger #mumbailife #mumbai_igers #mumbai_ig #mumbaidiaries #instamumbai #instafood #instagood #instapizza #pizza"],
