    "schedule_status": "Closed Opens at 17:00",
    "reviews": ["I recently visited this place winking owl located in Mira road.It is located opposite to petrol pump.Ambience, service and quality of food, everything was top notch.Here is the list of the food items I had:1)COCKTAILS:-A) Pineapple Pinacolada :  Combination of whiskey, coconut syrup and smashed pineapple which was served inside a vacant pineapple fruit.B) Long Island Iced Tea:  Long glass which had a sour and hydrated water which was very good to have.2)STARTERS:-A) Pataya Chicken: Soft and nice chicken served under coriander chutney was a treat to have.B) Veg Quesadilla : Quesadilla which had mixtures of vegetables in a bread .3)MAINS:-A) Chicken Khaw Suey: It is a Burmese dish which is cocktail of different sauces, veggies and churned garlic and onions.It was a treat to have4)DESSERTS:-A) Sizzling Brownie: Sweet and soft brownie was a treat to have.My ratings :Food :5\/5Service:5\/5Ambience:5\/5", "A very amazing and cosy place in Mira road. The music is very good. The servers served us well. We enjoyed all the dishes we ordered. The quantity as well as the quality was too good.", "Winking owl in mira road is a fun place after a tiring day at work. I was surprised to see that it was crowded on a Monday, that really speaks alot about this place. The ambiance is well lit, with sports screening the place is ideal for a good beer with some cricket match. The staff is polite and the service was quick. The menu is quite vast and there are options for everyone. We ordered- Drinks  MojitoSaifs mango mai tai Beat the heatAll of them were refreshing and delicious. Mojito was basic very cool and minty. Saifs mango mai tai tasted exactly like mango bite. Love the flavour of it. Beat the heat stands true to the name, a cucumber, mint mocktail. A good pick me up drink. Food Cheesy spicy chickenchoice of preparation fish grilled chicken szechun grill chickenAll of them were great and wholesome. The quantity is damn good. Cheesy spicy chicken wasn't exactly spicy but very cheesy. The taste was a bit mild but the flavour was great. Choice of fish had a few options for sauce we decided to go with sweet chilli. Very basic yet so good.szechun grill chicken was minced chicken kebab something I've never tried before. Very flavorful and my favourite dish here. Grilled chicken was too good. It had two chicken breast, some sauteed vegetables, and pepper rice, it also came along with bbq sauce. Must have here!"],
