    "schedule_status": "Closed Opens at 19:30",
    "reviews": ["Great place for Chinese", "really nice interior, atmosphere, and good food", "IMPERIAL CHINA - FOOD REVIEW ONLINE ( FRO)\n\n.\nLOCATION: HILTON MUMBAI INTERNATIONAL AIRPORT\nCUISINE: CHINESE, SINGAPOREAN, ASIAN\nAVERAGE COST: 3,500 for two people (approx.)\nWORKING HOURS: 7 PM \u2013 11:30 PM\nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO.\n.\nWhat we love here: Volcano Vegetables, Date Pan Cake, Salt & Pepper Prawns, Chicken Dim Sums, Tofu Claypot, Rapid Chicken, Jasmin Rice, Treasure Pouch.\n.\nWhy Visit: A place to cure Chinese food cravings with a wonderful ambience. .\nLocation: 4\nTaste: 4.5\nQuantity: 4\nPresentation: 4\nAmbience: 5\nHygiene: 5\nService: 5\nCost: 4.5\n.\nOur Review: 4.5 \/ 5\nCall it a perfect treat for all Chinese food lovers as @hiltonmumbai brings to you China\u2019s most celebrated tradition the \u2018Yum Cha\u2019 food festival to the city. This was our first visit to @hilton and we experienced simple and classy ambience with royal looking upholstery and tapestry. Back in China, \u2018Yum Cha\u2019 is a popular Cantonese tradition of brunch, involving refreshing Chinese tea and dim sum. Culminating the same at this festival, the exquisite wide spread curated by skilled sous chef Thomas Lai will let the guests savour the culinary essence with authentic dishes like Vegetable Momo, Lamb Dumpling, Pork Tangerine, Chicken Shu Mai, Prawn Shanghai, Fish Oyster and more. End this peculiar joint with a host of scrumptious desserts namely Honey Noodles with Ice Cream, Date Pancake With Ice Cream. With an elaborate array of vegetarian and non-vegetarian delicacies and delectable desserts, this is a meal you just can\u2019t miss! A special thanks to Chef Thomas, Ritesh and IBA from Service team for a perfect evening. .\n.\n.\nFollow @foodreviewonline or www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #mumbaifoodie #mumbaifoodiee #mumbaifoodguide #foodlover #mumbaifoodplaces #instamumbai #mumbaifoodlove #mumbaifoodlovers #zomato #zomatoindia #goodfood #goodvibes #foody #food #foodporn #foodie #instafood #foodie #foodblogger #chinesefood #tasty #dinner #noodle #asianfood #hilton #hiltonmumbai #imperialchina\n.\n@criessepr"],
