    "reviews": ["The food is amazing u must try their cakes and cookies", "I had one of the best cupcakes here.  #worthtrying", "GLUTTONY - FOOD REVIEW ONLINE (FRO)\n.\nLOCATION: Marol, Mumbai.\nCUISINE: BAKERY, DESSERTS\nAVERAGE COST: 400 for two (approx.)\nWORKING HOURS: 8 AM \u2013 1 AM \nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: NO\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: NO\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: YES\n.\nWhat we love here: Brownie, Cupcake, Mousse, Dark Chocolate, Dutch Truffle, Chocolate Mousse, Chocolate Nutella, cookies.\n.\nWhy Visit: Get yourself mesmerized by the variety of desserts this Cake Shop can serve. .\nLocation: 4\nTaste: 5\nQuantity: 5\nPresentation: 4\nAmbience: 4\nHygiene: 5\nService: 5\nCost: 5\n.\nOur Review: 4.5 \/ 5\n@gluttony53 serves a wide variety of toothsome treats, fresh from the oven. Known for being consistent with its quality as well as service, it is a great spot to visit in the company of colleagues to indulge and enjoy their preparations. The owner of Gluttony Hussain visited our office and like a happy Santa had a bag full of yummy desserts with him. We got our first-hand information as to how these desserts were prepared and what was special in them which clearly showed his passion towards his homegrown brand. We managed to try PASTRIES which simply melted in our mouth as we had our first bite, COOKIES were out of this world which was yummy and crunchy, CUPCAKES were not just unique in presentation but some of their flavours were mesmerizing AND finally BROWNIES which were so soft and delicious and treat to have. We feel Gluttony has the potential to be a great brand and with all of them being pure vegetarian and such great variety (130 types of cakes) they are only going places. We totally recommend them and would order blindfolded if we have to. .\n.\nDon\u2019t forget to follow our handle @foodreviewonline and for more such detailed restaurant reviews visit us on www.foodreviewonline.com\n.\n.\n#foodreviewonline #kailashshahaniofficial #mumbailocal #mumbai #mumbaikar #india #mumbailife #mumbaicity #mumbaispecial #mumbaiphotos #ig #mumbaimerijaan #maharashtra #mymumbai #mumbaiuntold #followforfollow #mumbaifoodie #mumbaifoodlovers #mumbaifoodblogger #mumbaifood #instamumbai #mumbaiblogger #pastry #cupcakes #desserts #gluttony"],
