    "top_ratings": ", Pub & bar",
    "phone": "(+91) 7769044144",
    "website": "http:\/\/www.theboatclub.in\/",
    "address": "Thakur Mall, near Dahisar Check Naka, Mumbai, Maharashtra, India",
    "price_score": 5,
    "cuisines": "Fast food",
    "schedule_status": "Closed Opens at 11:00",
    "reviews": ["I was at TBC for dinner with my family. We had reserved a table as I know the restaurant gets quite busy. I have been to TBC a few times before and the service and food have always been really good.But this time I was highly disappointed.1. Without even asking our preference we were given an option to choose between cold and normal bottled water which is paid. After we asked if there was regular water, the waiter said, yes sure. Talk about cheating customers to make more money.2. The waiter we had was kind of not interested in serving us. Anything we asked, the reply was always NO. My dad is hard of hearing and the music in the restaurant was too loud. Now if this was a sports bar or lounge, I understand the music will be loud. But this is a family please keep your music volume down where people can talk to each other. We asked the waiter if he could turn the music down a little bit and he laughed in our face saying this is not loud this is fine. really?3. The service was a complete let down. We had 1 waiter getting 1 thing. the other getting something else. any food coming out anytime, just chaos.", "The Boat Club .\nLOCATION: 2nd Floor, Thakur Mall, Mira Road, Mumbai\nCUISINE: CONTINENTAL, NORTH INDIAN, CHINESE, SALAD\nAVERAGE COST: 1500 for two people (approx.)\nWORKING HOURS: 11 AM \u2013 11:30 PM\nDISABLED FRIENDLY: YES\nOUTDOOR SEATING: NO\nVALET PARKING: YES\nCREDIT CARD PAYMENT: YES\nTAKEAWAY: YES\nFREE WIFI: YES\nKIDS FRIENDLY: YES\nVEGETARIAN ONLY: NO\n.\nWhat we love here: Tandoori Prawns, Nachos, Cocktails, Peri Peri Chicken, Vanilla Ice Cream, Brownie, Rabri. \nWhy Visit: One of the most Hygienic place you could find in Mira Road which is built on the concept of the boat structure.\n.\nLocation: 4\nTaste: 4.5\nQuantity: 4.5\nPresentation: 4 \nAmbience: 4.5\nHygiene: 4.5\nService: 4.5\nCost: 4.5\n.\nOur Review: 4.5 \/ 5: \nThe Boat Club Restaurant could be found in Thakur Mall, Mira Road. A best source of getting a cruising experience on land giving a serene experience while you dine here. First of all it's hard to find good Italian food and craft beer in Mira road. Well, TBC solved that problem now. They play good music at the TBC and one of the most hygienic place with hand sanitizers on every table not every restaurant does that. The unisex washroom was neat and clean. The restaurant's ambiance screams the Naval decor. The seating\u2019s are spread out and can accommodate a couple to a group of 15 with ease. Tandoori Prawns was one of their recommended dish, the size of the prawns served is bigger than average & it's freshly cooked, juicy & divine to taste. The staff is extremely courteous and very well trained. Glass is refilled without waiting or pointing out, the tables are cleaned out after each meal course. All dishes are priced just about right and you don\u2019t really feel its heavy on the pocket and here is the kicker if you are Zomato Gold member you get Buy 1 Get 1 free on Food Only which is worth a steal at TBC. Overall, we recommend foodies to visit this place and take a bite off its offerings and if you won\u2019t be disappointed.\n.\n#foodreviewonline #staunchtravelerofficial #foodie #foodlover #foodaddict #foodblogger #food #foods #snacks #foody #foodgram #foodislife #foodlovers #foodielife #foodpic #yum #tasty #foodblog #foodshare #foodaholic #foodspotting #goodfood", "Location: 2nd Floor, Thakur Mall, Mira Road, Mumbai\nCuisine: continental, north indian, chinese, salad\nAverage cost: 1500 for two people (approx.)\nWorking hours: 11 am \u2013 11:30 pm\nDisabled friendly: yes\nOutdoor seating: no\nValet parking: yes\nCredit card payment: yes\nTakeaway: yes\nFree wifi: yes\nKids friendly: yes\nVegetarian only: no\n.\nWhat we love here: tandoori prawns, nachos, cocktails, peri peri chicken, vanilla ice cream, brownie, rabri. \nWhy visit: one of the most hygienic place you could find in mira road which is built on the concept of the boat structure.\n.\nLocation: 4\nTaste: 4.5\nQuantity: 4.5\nPresentation: 4 \nAmbience: 4.5\nHygiene: 4.5\nService: 4.5\nCost: 4.5\n.\nOur review: 4.5 \/ 5: \nThe Boat Club Restaurant could be found in Thakur Mall, Mira Road. A best source of getting a cruising experience on land giving a serene experience while you dine here. First of all it's hard to find good Italian food and craft beer in Mira road. Well, TBC solved that problem now. They play good music at the TBC and one of the most hygienic place with hand sanitizers on every table not every restaurant does that. The unisex washroom was neat and clean. The restaurant's ambiance screams the Naval decor. The seating\u2019s are spread out and can accommodate a couple to a group of 15 with ease. Tandoori Prawns was one of their recommended dish, the size of the prawns served is bigger than average & it's freshly cooked, juicy & divine to taste. The staff is extremely courteous and very well trained. Glass is refilled without waiting or pointing out, the tables are cleaned out after each meal course. All dishes are priced just about right and you don\u2019t really feel its heavy on the pocket and here is the kicker if you are Zomato Gold member you get Buy 1 Get 1 free on Food Only which is worth a steal at TBC. Overall, we recommend foodies to visit this place and take a bite off its offerings and if you won\u2019t be disappointed.\n.\n#foodreviewonline #staunchtravelerofficial #foodie #foodlover #foodaddict #foodblogger #food #foods #snacks #foody #foodgram #foodislife #foodlovers #foodielife #foodpic #yum #tasty #foodblog #foodshare #foodaholic #foodspotting #goodfood"],
