    "reviews": ["Breadth is What You need to LIVE and Food is what\nyou need to survive.\n\nGood Food creates the good mood.A place which serves both under one roof Good food + Good mood.\nBREADTH in Miraroad\nThe Ambience is just so perfect to hangout.\nAmazing decors, Wall paintings, and lightings.\nA perfect place to chill with your friends and loved one&#039;s.\n\nWhat I had\n\nHarissa Chicken\nSoft fried chicken pieces served in leaf of cabbage taste so amazing.\nIts gives that continental food feelings to your taste buds.\nMust Recommmended.\n\nChicken Projasky Sizzler\nHot smooky Mexican rice mixed with French fries, Exotic veg served with Spicy Chilly sauce.\nA perfect mixture main course to to settle your hunger.\n\nRawas Tawa Fry\nSpicy Fish chopped and fried served with chilly flakes makes this dish so delicious.\nMust Recommened for spicy lovers\n\nBluemoon\nBluemoon is the refesher cocktail which boost your energy to enjoy the delightful environment of this amazing place.\n\nAlphanso Twist\nA smoothie which gives you the real taste of our favourtie Mango.\nMust Recommended\n\nCaramel Custard\nIn desert I had this tasty creamy caramel caustard to complete my meal on sweeter note.\n\nThis place also has Bar Menu.\n\nRatings - 4\/5\nAmbience - 5\/5\nFood - 4\/5\nTaste - 5\/5\nHospitality - 5\/5", " This is one ideal place to chill around with your friends and cousins and even your colleagues!\n\nWent here with my office group on Diwali for some booze.\n\nThe place was so crowded but somehow we managed to get a table.\n\nBartenders here are amazing! Cocktails which we tried were just soo goood!\nAlso finger foods were delicious!\n\nDefinitely going here again for some other celebration! ", " Breathe is a good place to try out variety of cuisine. I personally think like it&#039;s options of mushroom specials like Cream of mushroom, Mushroom noorani kebab and\nMushroom baby corn chilly with Burnt chilli garlic noodles and do t forget to try the Tipan prawns "],
