    "reviews": ["Excellent place to go with family.... Great food", "Good! But too costly", " Persian Darbar is a paradise for non vegetarian and the food is finger liking good\n\nShort Review: Food ordered\n1) Chicken Kalamiri: Absolutely tender chicken and recommended \u2606\u2606\u2606\u2606\u2606\n2) Veg Platter: Paneer was literally melting in your mouth, variety of veggies in the platter\u2606\u2606\u2606\u2606\n3) Butter Chicken: Finger licking good \u2606\u2606\u2606\u2606\u2606\n4) Veg Makhanwala: Good \u2606\u2606\u2606\u2606\n5) Flaooda: Mouth watering \u2606\u2606\u2606\u2606\u2606\n\n-------------------------------------------------------------------------------------------\nLong Review: 1) Chicken Kalamari: The chicken was sooooo tender that no efforts was required to chew it, definetly its a paradise for non vegetarian. Definetly to try here \u2606\u2606\u2606\u2606\u2606\n\n2) Veg platter: There was atleast 5-6 types diffrent veggies and paneer in it, they can definetly give competion to any pure veg restaurant.\u2606\u2606\u2606\u2606\u2606\n\n3) Butter Chicken: No words, please please try it and you will be speechless. \u2606\u2606\u2606\u2606\u2606\n\n4) Veg Makhanwala: Again i will say they will make any veg restaurant run for their money\n\n5) Flaooda: A great way to end your meal here\u2606\u2606\u2606\u2606\u2606\n\nWorth: Yes... it may seem a bit expensive but belive me it is worth your money\n\nImprovements: Everything was perfect for me. "],
